<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>WOO's game</title>
    <style>
        :root {
            --bg-color: #121214;
            --panel-color: #1e1e24;
            --text-color: #e0e0e0;
            --accent-color: #00a8ff;
            --highlight-color: #ffeaa7;
        }

        body {
            margin: 0;
            background-color: var(--bg-color);
            color: var(--text-color);
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            height: 100vh;
            overflow: hidden;
            user-select: none;
        }

        h1 {
            font-size: 1.2rem;
            margin: 5px 0;
            text-transform: uppercase;
            letter-spacing: 2px;
            color: #81ecec;
            display: flex;
            align-items: center;
            gap: 10px;
        }

        #main-layout {
            display: flex;
            gap: 20px;
            padding: 20px;
            align-items: flex-start;
            justify-content: center;
            width: 100%;
            max-width: 1400px;
        }

        #game-container {
            position: relative;
            width: 900px;
            height: 600px;
            border: 2px solid #444;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.5);
            background: #000;
        }

        /* Tutorial Highlights */
        .tutorial-highlight-ui {
            border: 2px solid #ffeaa7 !important;
            box-shadow: 0 0 15px #ffeaa7 !important;
            animation: pulse-border 1.5s infinite;
            z-index: 10001;
            position: relative;
        }

        @keyframes pulse-border {
            0% {
                box-shadow: 0 0 5px #ffeaa7;
            }

            50% {
                box-shadow: 0 0 20px #ffeaa7;
            }

            100% {
                box-shadow: 0 0 5px #ffeaa7;
            }
        }

        canvas {
            display: block;
            image-rendering: pixelated;
            cursor: crosshair;
        }

        #tools-wrapper {
            display: flex;
            flex-direction: column;
            gap: 10px;
            width: 220px;
        }

        .section-label {
            width: 100%;
            text-align: center;
            font-size: 0.7rem;
            color: #666;
            margin-bottom: 2px;
            text-transform: uppercase;
            letter-spacing: 1px;
        }

        .tool-btn {
            background: #2f3640;
            border: 2px solid #444;
            color: #fff;
            padding: 6px 12px;
            border-radius: 4px;
            cursor: pointer;
            font-weight: bold;
            transition: all 0.1s;
            text-transform: uppercase;
            font-size: 0.75rem;
            display: flex;
            align-items: center;
            gap: 5px;
        }

        .tool-btn:hover {
            background: #353b48;
            transform: translateY(-1px);
        }

        .tool-btn.active {
            border-color: #fff;
            box-shadow: 0 0 8px rgba(255, 255, 255, 0.3);
        }

        /* Tool Colors */
        #btn-select {
            border-bottom: 4px solid #fff;
        }

        #btn-wall {
            border-bottom: 4px solid #808080;
        }

        #btn-sand {
            border-bottom: 4px solid #e1b12c;
        }

        #btn-creeper {
            border-bottom: 4px solid #4834d4;
        }

        #btn-anticreeper {
            border-bottom: 4px solid #dfe6e9;
        }

        #btn-dirt {
            border-bottom: 4px solid #654321;
        }

        #btn-bedrock {
            border-bottom: 4px solid #1e1e1e;
        }

        #btn-water {
            border-bottom: 4px solid #0077be;
        }

        #btn-lava {
            border-bottom: 4px solid #cf1020;
        }

        #btn-steam {
            border-bottom: 4px solid #dcdcdc;
        }

        #btn-ac-resource {
            border-bottom: 4px solid #ff69b4;
        }

        #btn-emitter {
            border-bottom: 4px solid #ff4757;
        }

        #btn-ac-emitter {
            border-bottom: 4px solid #74b9ff;
        }

        #btn-build-fighter {
            border-bottom: 4px solid #fab1a0;
        }

        #btn-build-nullifier {
            border-bottom: 4px solid #a29bfe;
        }

        #btn-build-sprayer {
            border-bottom: 4px solid #74b9ff;
        }

        #btn-mine {
            border-bottom: 4px solid #00b894;
        }

        #btn-build-miner {
            border-bottom: 4px solid #d63031;
        }

        .ui-panel {
            width: 100%;
            background: rgba(30, 30, 30, 0.9);
            padding: 15px;
            border-radius: 10px;
            border: 1px solid #444;
            color: #fff;
            font-family: 'Courier New', monospace;
            display: flex;
            flex-direction: column;
            gap: 8px;
            max-height: 580px;
            overflow-y: auto;
            scrollbar-width: thin;
            scrollbar-color: #666 #222;
        }

        /* Scrollbar Styling for WebKit */
        .ui-panel::-webkit-scrollbar {
            width: 8px;
        }

        .ui-panel::-webkit-scrollbar-track {
            background: #222;
            border-radius: 4px;
        }

        .ui-panel::-webkit-scrollbar-thumb {
            background: #666;
            border-radius: 4px;
        }

        .ui-panel::-webkit-scrollbar-thumb:hover {
            background: #888;
        }

        /* Settings Panel for Emitters */
        #settings-panel {
            margin-top: 5px;
            background: #2d3436;
            padding: 8px;
            border-radius: 4px;
            display: none;
            /* Hidden until selected */
            flex-direction: column;
            gap: 5px;
            width: 100%;
            max-width: 600px;
        }

        .setting-row {
            display: flex;
            justify-content: space-between;
            align-items: center;
            font-size: 0.8rem;
        }

        input[type=range] {
            width: 150px;
            cursor: pointer;
        }

        #ship-controls {
            position: absolute;
            color: #ff4757;
            font-size: 0.8rem;
            margin-left: 10px;
            display: none;
        }

        #stats-overlay {
            position: absolute;
            top: 10px;
            left: 10px;
            width: 250px;
            pointer-events: none;
            display: flex;
            flex-direction: column;
            gap: 5px;
        }

        #fps-counter {
            position: absolute;
            bottom: 5px;
            right: 5px;
            color: #00ff00;
            font-family: monospace;
            font-size: 12px;
            pointer-events: none;
            background: rgba(0, 0, 0, 0.5);
            padding: 2px 5px;
            border-radius: 4px;
        }

        .stat-bar-container {
            background: rgba(0, 0, 0, 0.5);
            border-radius: 4px;
            padding: 5px;
            display: flex;
            flex-direction: column;
        }

        .stat-label {
            font-size: 12px;
            color: #ccc;
            margin-bottom: 2px;
            display: flex;
            justify-content: space-between;
        }

        .stat-bar-bg {
            width: 100%;
            height: 8px;
            background: #333;
            border-radius: 4px;
            overflow: hidden;
        }

        .stat-bar-fill {
            height: 100%;
            width: 0%;
            transition: width 0.2s;
        }

        #bar-creeper {
            background: #4040ff;
        }

        #bar-ac {
            background: #dcdcdc;
        }

        #btn-save-map {
            border-bottom: 4px solid #6c5ce7;
            display: none;
            /* Hidden by default, shown in create mode */
        }

        /* Main Menu Overlay */
        #main-menu {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            z-index: 10000;
        }

        #main-menu h1 {
            font-size: 48px;
            color: #fff;
            margin-bottom: 50px;
            text-shadow: 0 0 20px rgba(85, 239, 196, 0.5);
        }

        .menu-btn {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            border: none;
            padding: 20px 60px;
            font-size: 24px;
            margin: 15px;
            cursor: pointer;
            border-radius: 10px;
            transition: transform 0.2s, box-shadow 0.2s;
            font-family: 'Courier New', monospace;
            font-weight: bold;
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.3);
        }

        .menu-btn:hover {
            transform: translateY(-3px);
            box-shadow: 0 6px 20px rgba(102, 126, 234, 0.4);
        }

        .menu-btn:active {
            transform: translateY(-1px);
        }

        #level-select,
        #victory-screen {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(15, 15, 20, 0.95);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            z-index: 2000;
            color: white;
        }

        .level-btn {
            width: 300px;
            padding: 15px;
            margin: 10px;
            font-size: 1.2rem;
            background: #2d3436;
            color: white;
            border: 2px solid #444;
            cursor: pointer;
            border-radius: 8px;
            text-align: left;
            transition: all 0.2s;
        }

        .level-btn:hover:not(:disabled) {
            background: #0984e3;
            border-color: #74b9ff;
            transform: translateX(10px);
        }

        .level-btn:disabled {
            opacity: 0.5;
            cursor: not-allowed;
            background: #1e272e;
        }

        .level-status {
            float: right;
            font-size: 0.8rem;
        }
    </style>
</head>

<body>
    <!-- Main Menu -->
    <div id="main-menu">
        <h1>üéÆ WooGame</h1>
        <button class="menu-btn" onclick="showLevelSelect()">üèÜ Campaign</button>
        <button class="menu-btn" onclick="startGame('create')">üõ†Ô∏è Create Map</button>
    </div>

    <!-- Level Select Screen -->
    <div id="level-select" style="display: none;">
        <h1>Select Level</h1>
        <div id="level-list">
            <!-- Levels injected here -->
        </div>
        <button class="menu-btn"
            onclick="document.getElementById('level-select').style.display='none'; document.getElementById('main-menu').style.display='flex'">‚¨ÖÔ∏è
            Back</button>
    </div>

    <!-- Victory Screen -->
    <div id="victory-screen" style="display: none;">
        <h1>üéâ VICTORY! üéâ</h1>
        <p>All Emitters Destroyed!</p>
        <button class="menu-btn" onclick="nextLevel()">‚û°Ô∏è Next Level</button>
        <button class="menu-btn" onclick="returnToMenu()">üè† Menu</button>
    </div>

    <!-- Tutorial Overlay -->
    <div id="tutorial-overlay"
        style="display: none; position: absolute; bottom: 120px; left: 50%; transform: translateX(-50%); background: rgba(0, 0, 0, 0.8); padding: 20px; border: 2px solid #00a8ff; border-radius: 10px; color: white; z-index: 1000; max-width: 600px; text-align: center; pointer-events: auto;">
        <div id="tutorial-text" style="font-size: 1.2rem; margin-bottom: 15px;"></div>
        <button id="tutorial-next-btn" class="tool-btn" style="margin: 0 auto; font-size: 1rem; padding: 8px 20px;">Next
            ‚û°Ô∏è</button>
    </div>

    <h1>WOO's game <span style="font-size: 0.8em; color: #666;">| Base Builder</span></h1>

    <div id="main-layout">
        <div id="game-container">
            <canvas id="simCanvas" width="300" height="200" style="width: 900px; height: 600px;"></canvas>
            <div id="cursor-info" class="info-panel" style="right: 10px; left: auto; top: 10px;">Hover Info</div>
            <div id="ship-controls">Ship Selected: Click to Move</div>
            <div id="power-bar-container">
                <div id="power-bar-fill"></div>
                <span id="power-text">Apex Power: 0 / 1000</span>
            </div>
            <div id="stats-overlay">
                <div class="stat-bar-container">
                    <div class="stat-label">
                        <span>Creeper</span>
                        <span id="val-creeper">0</span>
                    </div>
                    <div class="stat-bar-bg">
                        <div id="bar-creeper" class="stat-bar-fill"></div>
                    </div>
                </div>
                <div class="stat-bar-container">
                    <div class="stat-label">
                        <span>Anti-Creeper</span>
                        <span id="val-ac">0</span>
                    </div>
                    <div class="stat-bar-bg">
                        <div id="bar-ac" class="stat-bar-fill"></div>
                    </div>
                </div>
            </div>
            <div id="fps-counter">FPS: 0</div>
        </div>

        <div id="tools-wrapper">
            <!-- PLAY CONTROLS (Visible in Play Mode) -->
            <div id="play-controls" class="ui-panel" style="display: none;">
                <div class="section-label">Units</div>
                <button class="tool-btn" id="btn-select" onclick="setTool('select')">üëÜ Select</button>
                <button class="tool-btn" id="btn-build-fighter" onclick="setTool('build_fighter')">üõ†Ô∏è Fighter</button>
                <button class="tool-btn" id="btn-build-sprayer" onclick="setTool('build_sprayer')">üöø Sprayer</button>
                <button class="tool-btn" id="btn-build-nullifier" onclick="setTool('build_nullifier')">üö´
                    Nullifier</button>
                <button class="tool-btn" id="btn-build-miner" onclick="setTool('build_miner')">üî© R-Miner</button>
                <button class="tool-btn" id="btn-mine" onclick="setTool(0)">‚õèÔ∏è Mine</button>
                <span id="limit-warning">MAX UNITS REACHED</span>
            </div>

            <!-- CREATE CONTROLS (Visible in Create Mode) -->
            <div id="create-controls" class="ui-panel" style="display: none;">
                <div class="section-label">Creative Tools</div>

                <!-- Brushes -->
                <div style="display: flex; flex-wrap: wrap; gap: 5px; justify-content: center;">
                    <button class="tool-btn" id="btn-eraser" onclick="setTool(0)">üßΩ Eraser</button>
                    <button class="tool-btn" id="btn-wall" onclick="setTool(1)">üß± Wall</button>
                    <button class="tool-btn" id="btn-sand" onclick="setTool(2)">‚è≥ Sand</button>
                    <button class="tool-btn" id="btn-dirt" onclick="setTool(10)">üü´ Dirt</button>
                    <button class="tool-btn" id="btn-bedrock" onclick="setTool(11)">‚¨õ Bedrock</button>
                    <button class="tool-btn" id="btn-creeper" onclick="setTool(3)">üíß Creeper</button>
                    <button class="tool-btn" id="btn-anticreeper" onclick="setTool(4)">üõ°Ô∏è AC</button>
                    <button class="tool-btn" id="btn-water" onclick="setTool(12)">üåä Water</button>
                    <button class="tool-btn" id="btn-lava" onclick="setTool(13)">üåã Lava</button>
                    <button class="tool-btn" id="btn-steam" onclick="setTool(15)">‚òÅÔ∏è Steam</button>
                    <button class="tool-btn" id="btn-ac-resource" onclick="setTool(9)">üíé Res</button>
                </div>

                <div style="width: 100%; height: 1px; background: #444; margin: 10px 0;"></div>

                <!-- Entities -->
                <div class="section-label">Entities</div>
                <div style="display: flex; gap: 5px; justify-content: center;">
                    <button class="tool-btn" id="btn-select-create" onclick="setTool('select')">üëÜ Select</button>
                    <button class="tool-btn" id="btn-place-emitter" onclick="setTool('place_emitter')">‚ö†Ô∏è
                        Emitter</button>
                    <button class="tool-btn" id="btn-place-spawner" onclick="setTool('place_spawner')">üí†
                        Spawner</button>
                    <button class="tool-btn" id="btn-place-apex" onclick="setTool('place_apex')">üöÄ Apex Start</button>
                </div>

                <div style="width: 100%; height: 1px; background: #444; margin: 10px 0;"></div>

                <!-- Settings -->
                <div style="display: flex; align-items: center; gap: 10px;">
                    <button class="tool-btn" id="btn-play-pause" onclick="togglePause()"
                        style="width: 40px;">‚è∏Ô∏è</button>
                    <label for="brush-size" style="font-size: 12px; color: #aaa;">Brush Size: <span
                            id="val-brush">3</span></label>
                    <input type="range" id="brush-size" min="1" max="10" value="3" style="width: 100px;"
                        oninput="updateBrushSize(this.value)">
                </div>

                <div style="width: 100%; height: 1px; background: #444; margin: 10px 0;"></div>

                <!-- Map Utils -->
                <div style="display: flex; gap: 5px; flex-wrap: wrap;">
                    <button class="tool-btn" onclick="saveMap()">üíæ Save</button>
                    <button class="tool-btn" onclick="loadSavedMap()">üìÇ Load</button>
                    <button class="tool-btn" onclick="exportMap()">üìã Export</button>
                    <button class="tool-btn" onclick="if(confirm('Clear Map?')) loadEmptyMap()"
                        style="border-bottom: 4px solid #d63031;">üóëÔ∏è Clear</button>
                    <button class="tool-btn" onclick="document.getElementById('main-menu').style.display='flex'">üè†
                        Menu</button>
                </div>
            </div>

            <!-- Contextual Settings (Emitter/Sprayer) -->
            <div id="settings-panel">
                <div class="section-label" style="color: #ffeaa7; margin-bottom: 5px;">Settings</div>
                <div class="setting-row">
                    <span>Spawn Radius: <span id="val-radius">1</span></span>
                    <input type="range" id="inp-radius" min="0" max="10" step="1"
                        oninput="updateEmitterSetting('radius', this.value)">
                </div>
                <div class="setting-row">
                    <span>Intensity (Density): <span id="val-amount">5</span></span>
                    <input type="range" id="inp-amount" min="1" max="50" step="1"
                        oninput="updateEmitterSetting('amount', this.value)">
                </div>
                <div class="setting-row">
                    <span>Rate: <span id="val-rate">5</span></span>
                    <input type="range" id="inp-rate" min="1" max="60" step="1"
                        oninput="updateEmitterSetting('rate', this.value)">
                </div>
                <button id="btn-toggle-mode" class="tool-btn" style="margin-top: 10px; display: none;"
                    onclick="toggleSprayerMode()">Mode: Always</button>
            </div>
        </div>
    </div>

    <script>
        // --- CONFIGURATION ---
        const canvas = document.getElementById('simCanvas');
        const ctx = canvas.getContext('2d');
        const width = canvas.width;
        const height = canvas.height;
        const cursorInfo = document.getElementById('cursor-info');
        const settingsPanel = document.getElementById('settings-panel');
        const shipControls = document.getElementById('ship-controls');
        const limitWarning = document.getElementById('limit-warning');

        // Material Types
        const EMPTY = 0;
        const WALL = 1;
        const SAND = 2;
        const CREEPER = 3;
        const ANTI_CREEPER = 4;
        const AC_PARTICLE = 8;
        const AC_RESOURCE = 9;
        const DIRT = 10;
        const BEDROCK = 11;
        const WATER = 12;
        const LAVA = 13;
        const STONE = 14;
        const STEAM = 15;

        const AC_PARTICLE_AMOUNT = 50.0;

        const TYPE_MASK = 0xFF;
        const MARKED_MASK = 0x100;

        // Physics Constants
        const GRAVITY = 0.2;
        const TERMINAL_VELOCITY = 3.0;
        const BUILD_RANGE = 80;
        const MAX_FIGHTERS = 5;

        // Projectile Constants
        const PROJ_SPEED = 4.0;
        const PROJ_EXPLOSION_RADIUS = 8;
        const MISSILE_EXPLOSION_RADIUS = 20; // New radius for Apex missiles
        const MISSILE_MIN_DENSITY_TARGET = 5.0; // Min density required to fire a missile
        const NULLIFIER_RANGE = 100; // Nullifier targeting range

        const properties = {
            [EMPTY]: { color: [0, 0, 0], density: 0, liquid: false, solid: false },
            [WALL]: { color: [100, 100, 100], density: 1000, liquid: false, solid: true },
            [SAND]: { color: [225, 177, 44], density: 10, liquid: false, solid: true },
            [CREEPER]: { color: [64, 64, 255], density: 1.0, liquid: true, solid: false },
            [ANTI_CREEPER]: { color: [220, 220, 255], density: 1.0, liquid: true, solid: false },
            [AC_PARTICLE]: { color: [0, 200, 255], density: 10, liquid: false, solid: true }, // Acts solid for movement
            [AC_RESOURCE]: { color: [255, 105, 180], density: 10, liquid: false, solid: true }, // Bright pink resource
            [DIRT]: { color: [101, 67, 33], density: 100, liquid: false, solid: true }, // Static solid
            [BEDROCK]: { color: [30, 30, 30], density: 9999, liquid: false, solid: true }, // Unmineable
            [WATER]: { color: [0, 119, 190], density: 1.0, liquid: true, solid: false },
            [LAVA]: { color: [207, 16, 32], density: 2.0, liquid: true, solid: false },
            [STONE]: { color: [128, 128, 128], density: 100, liquid: false, solid: true },
            [STEAM]: { color: [220, 220, 220], density: 0.5, liquid: true, solid: false, gas: true } // Gas rises
        };

        // Tool State
        let brushSize = 3;
        let startPaintPos = null; // For shift-lock
        let isPaused = false;

        // GLOBAL DATA STRUCTURES
        let grid = new Uint32Array(width * height); // Changed to Uint32 to handle flags safely
        let densityGrid = new Float32Array(width * height);
        let entities = [];
        let projectiles = [];
        let packets = [];

        // --- ENTITY SYSTEM ---
        class Entity {
            constructor(x, y, type) {
                this.x = x;
                this.y = y;
                this.type = type; // 'EMITTER', 'AC_EMITTER', 'APEX', 'FIGHTER', 'NULLIFIER', 'SPRAYER', 'SPAWNER', 'RESOURCE_MINER'
                this.vx = 0;
                this.vy = 0;
                this.width = 10;
                this.height = 10;
                this.dead = false;
                this.built = true; // Default true, false for player buildings
                this.acResource = 0;
                this.acStorage = 0;
                this.maxAcStorage = 200;
                this.packetTimer = 0;

                // Health System
                this.maxHealth = 100;
                if (type === 'APEX') this.maxHealth = 1000;
                else if (type === 'FIGHTER') this.maxHealth = 100;
                else if (type === 'NULLIFIER') this.maxHealth = 200;
                else if (type === 'SPRAYER') this.maxHealth = 150;
                else if (type === 'RESOURCE_MINER') this.maxHealth = 50;
                else if (type === 'EMITTER' || type === 'AC_EMITTER') this.maxHealth = 5000; // Emitters are tough but destroyable via nullifier only usually

                this.health = this.maxHealth;

                // Building system
                this.buildProgress = 0;

                // Emitter Stats
                if (type === 'EMITTER' || type === 'AC_EMITTER') {
                    this.spawnType = (type === 'AC_EMITTER') ? ANTI_CREEPER : CREEPER;
                    this.spawnRadius = 2;
                    this.spawnAmount = 5.0;
                    this.productionRate = 5;
                    this.productionTimer = 0;
                }

                // Spawner Stats (naturally spawning resource generators)
                if (type === 'SPAWNER') {
                    this.width = 8;
                    this.height = 8;
                    this.productionRate = 60; // Spawn every 60 frames (1 second at 60fps)
                    this.productionTimer = 0;
                    this.maxNearbyResources = 100; // Stop spawning if this many nearby
                    this.resourceCheckRadius = 20;
                }

                // Resource Miner Stats
                if (type === 'RESOURCE_MINER') {
                    this.width = 6;
                    this.height = 6;
                    this.built = false;
                    this.buildReq = 15; // Needs 15 packets to build
                    this.miningRange = 40;
                    this.miningTimer = 0;
                    this.resourceCollected = 0; // Track how much mined
                    this.targetResource = null; // Currently mining this position
                }

                // Ship Stats
                if (type === 'APEX' || type === 'FIGHTER' || type === 'SPRAYER') {
                    this.targetX = x;
                    this.targetY = y;
                    this.fireTimer = 0;

                    if (type === 'APEX') {
                        this.width = 11;
                        this.height = 15;
                        this.fireRate = 45; // Slower fire rate for heavy missile
                        this.moveSpeed = 1.0;
                        this.packetTimer = 0;
                        this.miningRange = 80;
                        this.maxPower = 1000;
                        this.power = 1000; // Starts full
                        // NEW: AC Resource System
                        this.acResource = 0; // Raw AC resource count
                        this.acStorage = 0; // Converted AC units
                        this.maxAcStorage = 500; // Max AC storage
                    } else if (type === 'FIGHTER') {
                        this.width = 7;
                        this.height = 7;
                        this.fireRate = 20; // Faster for fighters
                        this.moveSpeed = 1.8;
                        this.built = false; // Starts unbuilt
                        this.buildReq = 20; // Needs 20 packets
                        this.maxPower = 100;
                        this.power = 0; // Starts empty
                    } else if (type === 'SPRAYER') {
                        this.width = 7;
                        this.height = 7;
                        this.fireRate = 20; // Slower fire
                        this.moveSpeed = 1.5;
                        this.built = false;
                        this.buildReq = 25;
                        this.mode = 0; // 0 = Always, 1 = Smart
                        // NEW: AC Ammo System
                        this.acAmmo = 0; // Current AC ammunition
                        this.maxAcAmmo = 200; // Max capacity
                    }
                }

                // Nullifier Stats
                if (type === 'NULLIFIER') {
                    this.width = 6;
                    this.height = 6;
                    this.built = false;
                    this.buildReq = 50; // Needs 50 packets
                    this.charge = 0;
                    this.range = NULLIFIER_RANGE;
                    this.target = null;
                    this.targetX = x; // Nullifiers can move now
                    this.targetY = y;
                    this.moveSpeed = 0.8; // Slower than fighters
                }
            }
        }

        class Packet {
            constructor(x, y, target, type = 'BUILD', value = 1) {
                this.x = x;
                this.y = y;
                this.target = target;
                this.speed = 3.0;
                this.dead = false;
                this.type = type; // 'BUILD', 'POWER', 'AC_RESOURCE', or 'AC_AMMO'
                this.value = value;
                this.path = null; // Will store array of {x, y} waypoints
                this.pathIndex = 0; // Current waypoint index
                this.needsRepath = false;
                // Stuck detection
                this.lastX = x;
                this.lastY = y;
                this.stuckTimer = 0;
            }
        }

        class Projectile {
            constructor(x, y, vx, vy, isMissile = false, isParticle = false) {
                this.x = x;
                this.y = y;
                this.vx = vx;
                this.vy = vy;
                this.life = isMissile ? 120 : (isParticle ? 100 : 60);
                this.dead = false;
                this.isMissile = isMissile;
                this.isParticle = isParticle;
                this.explosionRadius = isMissile ? MISSILE_EXPLOSION_RADIUS : PROJ_EXPLOSION_RADIUS;
            }
        }

        // Rendering Buffers
        let imgData = ctx.createImageData(width, height);

        // --- UI / INPUT ---
        function setTool(tool) {

                selectedEntity = null;

        // Initial tool state
        let currentTool = 'emitter';

        let isRightClick = false;
        let frameCount = 0;

            const btnMap = {

        function updateEmitterSetting(key, val) {

            if (key === 'radius') selectedEntity.spawnRadius = val;

        function getMousePos(evt) {
            const rect = canvas.getBoundingClientRect();
            return {
                x: (evt.clientX - rect.left) * (canvas.width / rect.width),
                y: (evt.clientY - rect.top) * (canvas.height / rect.height)
            };
        }

        // Mouse Interaction
        canvas.addEventListener('mousedown', e => {
            isMouseDown = true;
            isRightClick = e.button === 2;
            const pos = getMousePos(e);
            startPaintPos = { x: pos.x, y: pos.y }; // Track start pos for shift-lock

            if (currentTool === 'select') {
                if (selectedEntity && ['APEX', 'FIGHTER', 'SPRAYER', 'NULLIFIER'].includes(selectedEntity.type) && !isRightClick && (selectedEntity.built || gameMode === 'create')) {
                    // Move Command
                    const clicked = entities.find(ent =>
                        Math.abs(ent.x - pos.x) < ent.width && Math.abs(ent.y - pos.y) < ent.height
                    );
                    if (!clicked) {
                        selectedEntity.targetX = pos.x;
                        selectedEntity.targetY = pos.y;
                        return;
                    }
                }

                // Select Entity
                const clicked = entities.find(ent =>
                    Math.abs(ent.x - pos.x) < ent.width && Math.abs(ent.y - pos.y) < ent.height
                );

                if (clicked) {
                    selectedEntity = clicked;
                    if (clicked.type === 'EMITTER' || clicked.type === 'AC_EMITTER') {
                        settingsPanel.style.display = 'flex';
                        shipControls.style.display = 'none';
                        document.getElementById('btn-toggle-mode').style.display = 'none'; // Hide sprayer mode button
                        updateSettingsValues();
                    } else if (['APEX', 'FIGHTER', 'SPRAYER', 'NULLIFIER'].includes(clicked.type)) {
                    } else {
                        settingsPanel.style.display = 'none';
                    }

                    if (clicked.type === 'SPRAYER') updateSprayerUI();
                    else document.getElementById('btn-toggle-mode').style.display = 'none';

                    if (['APEX', 'FIGHTER', 'SPRAYER', 'NULLIFIER'].includes(clicked.type)) {
                        shipControls.style.display = 'block';
                    } else {
                        shipControls.style.display = 'none';
                    }
                } else {
                    // Deselect if clicking empty space
                    if (!selectedEntity || !['APEX', 'FIGHTER', 'SPRAYER', 'NULLIFIER'].includes(selectedEntity.type)) {
                        selectedEntity = null;
                        settingsPanel.style.display = 'none';
                        shipControls.style.display = 'none';
                    }
                }
            }
            else if (currentTool === 'build_fighter') {
                // Building Logic
                if (!isRightClick) {
                    // 1. Check Limits
                    const fighterCount = entities.filter(e => e.type === 'FIGHTER').length;
                    if (fighterCount >= MAX_FIGHTERS) return;

                    // 2. Check Range to Apex
                    const apex = entities.find(e => e.type === 'APEX');
                    if (apex) {
                        const d = Math.sqrt((pos.x - apex.x) ** 2 + (pos.y - apex.y) ** 2);
                        if (d <= BUILD_RANGE) {
                            entities.push(new Entity(pos.x, pos.y, 'FIGHTER'));
                            updateUI();
                        }
                    }
                }
            }
            else if (currentTool === 'build_nullifier') {
                if (!isRightClick) {
                    const apex = entities.find(e => e.type === 'APEX');
                    if (apex) {
                        const d = Math.sqrt((pos.x - apex.x) ** 2 + (pos.y - apex.y) ** 2);
                        if (d <= BUILD_RANGE) {
                            entities.push(new Entity(pos.x, pos.y, 'NULLIFIER'));
                        }
                    }
                }
            }
            else if (currentTool === 'build_sprayer') {
                if (!isRightClick) {
                    const apex = entities.find(e => e.type === 'APEX');
                    if (apex) {
                        const d = Math.sqrt((pos.x - apex.x) ** 2 + (pos.y - apex.y) ** 2);
                        if (d <= BUILD_RANGE) {
                            entities.push(new Entity(pos.x, pos.y, 'SPRAYER'));
                        }
                    }
                }
            }
            else if (currentTool === 'build_miner') {
                if (!isRightClick) {
                    const apex = entities.find(e => e.type === 'APEX');
                    if (apex) {
                        const d = Math.sqrt((pos.x - apex.x) ** 2 + (pos.y - apex.y) ** 2);
                        if (d <= BUILD_RANGE) {
                            entities.push(new Entity(pos.x, pos.y, 'RESOURCE_MINER'));
                        }
                    }
                }
            }
            else if (['place_emitter', 'place_spawner', 'place_apex'].includes(currentTool)) {
                if (!isRightClick) {
                    if (currentTool === 'place_emitter') {
                        entities.push(new Entity(pos.x, pos.y, 'EMITTER'));
                    } else if (currentTool === 'place_spawner') {
                        entities.push(new Entity(pos.x, pos.y, 'SPAWNER'));
                    } else if (currentTool === 'place_apex') {
                        // Remove existing Apex
                        const existingApexIndex = entities.findIndex(e => e.type === 'APEX');
                        if (existingApexIndex !== -1) entities.splice(existingApexIndex, 1);
                        entities.push(new Entity(pos.x, pos.y, 'APEX'));
                    }
                }
            }
            else {
                handlePaint(pos);
            }
        });

        canvas.addEventListener('mousemove', e => {
            const pos = getMousePos(e);

            // Tooltip
            const tx = Math.floor(pos.x);
            const ty = Math.floor(pos.y);
            if (tx >= 0 && tx < width && ty >= 0 && ty < height) {
                const idx = ty * width + tx;
                const rawType = grid[idx];
                const type = rawType & TYPE_MASK;
                const marked = (rawType & MARKED_MASK) !== 0;
                const density = densityGrid[idx];
                let name = "Empty";
                if (type === WALL) name = "Wall";
                if (type === SAND) name = "Sand";
                if (type === CREEPER) name = "Creeper";
                if (type === ANTI_CREEPER) name = "Anti-Creeper";
                if (type === AC_PARTICLE) name = "AC Particle";
                if (type === AC_RESOURCE) name = "AC Resource";
                if (type === LAVA) name = "Lava";
                if (type === WATER) name = "Water";
                if (type === STONE) name = "Stone";
                if (type === BEDROCK) name = "Bedrock";
                if (type === DIRT) name = "Dirt";


                cursorInfo.innerText = `${name}${marked ? ' (Marked)' : ''}\nDensity: ${density.toFixed(1)}`;
            }

            if (isMouseDown && typeof currentTool === 'number') {
                // Shift-Lock Logic
                let targetPos = { x: pos.x, y: pos.y };
                if (e.shiftKey && startPaintPos) {
                    const dx = Math.abs(pos.x - startPaintPos.x);
                    const dy = Math.abs(pos.y - startPaintPos.y);
                    if (dx > dy) {
                        targetPos.y = startPaintPos.y; // Lock to horizontal
                    } else {
                        targetPos.x = startPaintPos.x; // Lock to vertical
                    }
                }
                handlePaint(targetPos);
            }
        });

        window.addEventListener('mouseup', () => {
            isMouseDown = false;
            startPaintPos = null;
        });
        canvas.addEventListener('contextmenu', e => e.preventDefault());

        function handlePaint(pos) {
            const radius = brushSize;
            const type = isRightClick ? EMPTY : currentTool;
            const px = Math.floor(pos.x);
            const py = Math.floor(pos.y);

            for (let y = -radius; y <= radius; y++) {
                for (let x = -radius; x <= radius; x++) {
                    if (x * x + y * y <= radius * radius) {
                        if (currentTool === 0) { // Mine Tool
                            const idx = (py + y) * width + (px + x);
                            if (idx >= 0 && idx < grid.length) {
                                const t = grid[idx] & TYPE_MASK;
                                if (t === BEDROCK && gameMode !== 'create') continue; // Cannot mine Bedrock unless in create mode

                                if (isRightClick) {
                                    grid[idx] &= ~MARKED_MASK; // Unmark
                                } else {
                                    if (t === WALL || t === SAND || t === DIRT || t === STONE) {
                                        grid[idx] |= MARKED_MASK; // Mark
                                    }
                                }
                            }
                        } else {
                            // Don't overwrite Bedrock unless we are placing Bedrock (maybe? no, bedrock is permanent)
                            // Actually, let's allow overwriting everything EXCEPT Bedrock, unless we are in creative mode?
                            // For now, simple rule: cannot paint over Bedrock
                            const idx = (py + y) * width + (px + x);
                            if (idx >= 0 && idx < grid.length) {
                                const existingType = grid[idx] & TYPE_MASK;
                                if (existingType !== BEDROCK || gameMode === 'create') {
                                    setCell(px + x, py + y, type);
                                }
                            }
                        }
                    }
                }
            }
        }

        function setCell(x, y, type) {
            if (x < 0 || x >= width || y < 0 || y >= height) return;
            const idx = y * width + x;
            const currentType = grid[idx] & TYPE_MASK;
            if (currentType === WALL && type !== EMPTY && type !== WALL) return;

            // Preserve mark if not overwriting with EMPTY (unless erasing)
            const mark = (grid[idx] & MARKED_MASK);
            grid[idx] = type | (type === EMPTY ? 0 : mark);

            if (properties[type].liquid) {
                if (densityGrid[idx] < 1.0) densityGrid[idx] = 1.0;
            } else if (properties[type].solid) {
                densityGrid[idx] = 100; // Max Health for solids
            } else {
                densityGrid[idx] = 0;
            }
        }

        // --- PHYSICS ENGINE ---

        function updateEntities() {
            // Find Apex for building logic
            const apex = entities.find(e => e.type === 'APEX');

            // 1. Packet Generation (Apex logic)
            if (apex && apex.built) {
                // Generate Power
                apex.power = Math.min(apex.maxPower, apex.power + 4.0); // Increased generation

                // AC Resource Conversion: 10 raw resources ‚Üí 50 AC units
                if (apex.acResource >= 10) {
                    const conversions = Math.floor(apex.acResource / 10);
                    apex.acResource -= conversions * 10;
                    apex.acStorage = Math.min(apex.maxAcStorage, apex.acStorage + conversions * 50);
                }

                // Find unbuilt fighters, nullifiers, sprayers, or resource miners
                // Find unbuilt fighters, nullifiers, sprayers, or resource miners
                const blueprints = entities.filter(e => (e.type === 'FIGHTER' || e.type === 'NULLIFIER' || e.type === 'SPRAYER' || e.type === 'RESOURCE_MINER') && !e.built);
                if (blueprints.length > 0) {
                    apex.packetTimer++;
                    if (apex.packetTimer >= 5) { // Emit packet every 5 frames
                        packets.push(new Packet(apex.x, apex.y, blueprints[0], 'BUILD', 1));
                        apex.packetTimer = 0;
                    }
                }

                // Distribute Power to Fighters
                if (apex.power >= 10) {
                    const hungryShips = entities.filter(e => e.type === 'FIGHTER' && e.built && e.power < e.maxPower * 0.5);
                    if (hungryShips.length > 0) {
                        // Simple round-robin or random for now
                        const target = hungryShips[Math.floor(Math.random() * hungryShips.length)];
                        packets.push(new Packet(apex.x, apex.y, target, 'POWER', 10));
                        apex.power -= 10;
                    }
                }

                // Distribute AC to Sprayers (Priority 1: Ammo)
                if (apex.acStorage >= 20) {
                    const hungrySprayers = entities.filter(e => e.type === 'SPRAYER' && e.built && e.acAmmo < e.maxAcAmmo * 0.5);
                    if (hungrySprayers.length > 0) {
                        const target = hungrySprayers[Math.floor(Math.random() * hungrySprayers.length)];
                        packets.push(new Packet(apex.x, apex.y, target, 'AC_AMMO', 20));
                        apex.acStorage -= 20;
                    }
                }

                // Repair Apex itself (Priority 2: Self-repair)
                if (apex.health < apex.maxHealth * 0.8 && apex.power >= 20) {
                    packets.push(new Packet(apex.x, apex.y, apex, 'REPAIR', 10));
                    apex.power -= 20;
                }

                // Repair other ships (Priority 3: Damaged allies)
                const damagedShips = entities.filter(e =>
                    ['FIGHTER', 'SPRAYER', 'NULLIFIER'].includes(e.type) &&
                    e.built &&
                    e.health < e.maxHealth * 0.7
                );
                if (damagedShips.length > 0 && apex.power >= 15) {
                    const target = damagedShips[Math.floor(Math.random() * damagedShips.length)];
                    packets.push(new Packet(apex.x, apex.y, target, 'REPAIR', 5));
                    apex.power -= 15;
                }
            }

            for (let i = entities.length - 1; i >= 0; i--) {
                let ent = entities[i];

                // Ship Physics
                if (['APEX', 'FIGHTER', 'SPRAYER', 'NULLIFIER'].includes(ent.type)) {

                    if (ent.built) {
                        updateShipPhysics(ent);

                        // Creeper Damage Logic
                        // Check grid cells under the ship
                        const cx = Math.floor(ent.x);
                        const cy = Math.floor(ent.y);
                        const r = Math.floor(ent.width / 2);
                        let takingDamage = false;

                        for (let dy = -r; dy <= r; dy += 2) {
                            for (let dx = -r; dx <= r; dx += 2) {
                                const sx = cx + dx;
                                const sy = cy + dy;
                                if (sx >= 0 && sx < width && sy >= 0 && sy < height) {
                                    const idx = sy * width + sx;
                                    if ((grid[idx] & TYPE_MASK) === CREEPER) {
                                        ent.health -= 0.5; // Constant damage per frame per cell
                                        takingDamage = true;
                                    }
                                }
                            }
                        }

                        if (ent.health <= 0) {
                            ent.dead = true;
                            createExplosion(ent.x, ent.y, 20, false);
                        }

                        // Update Nullifier targeting/charging (needs to run every frame)
                        if (ent.type === 'NULLIFIER') {
                            updateNullifier(ent);
                        }
                    } else {
                        // Blueprint Logic: Floating slightly, static
                        ent.vy = 0;
                        ent.grounded = true;
                    }

                    if (ent.dead) {
                        entities.splice(i, 1);
                        if (selectedEntity === ent) {
                            selectedEntity = null;
                            shipControls.style.display = 'none';
                            document.getElementById('btn-toggle-mode').style.display = 'none'; // Hide sprayer mode button
                        }
                        updateUI();
                    }
                    continue;
                }

                // Resource Miner - check creeper collision
                if (ent.type === 'RESOURCE_MINER') {
                    if (ent.built) {
                        // Check for creeper collision
                        const cx = Math.floor(ent.x);
                        const cy = Math.floor(ent.y);
                        let touchingCreeper = false;
                        const r = Math.floor(ent.width / 2);
                        for (let dy = -r; dy <= r; dy++) {
                            for (let dx = -r; dx <= r; dx++) {
                                const sx = cx + dx;
                                const sy = cy + dy;
                                if (sx >= 0 && sx < width && sy >= 0 && sy < height) {
                                    if ((grid[sy * width + sx] & TYPE_MASK) === CREEPER) {
                                        touchingCreeper = true;
                                        break;
                                    }
                                }
                            }
                            if (touchingCreeper) break;
                        }

                        if (touchingCreeper) {
                            ent.dead = true;
                            createExplosion(cx, cy, 8, false);
                        }
                    }
                    if (ent.dead) {
                        entities.splice(i, 1);
                    }
                }

                if (ent.dead) {
                    entities.splice(i, 1);
                    continue;
                }

                // Standard Gravity for Emitters
                if (!ent.grounded) {
                    ent.vy += GRAVITY;
                    if (ent.vy > TERMINAL_VELOCITY) ent.vy = TERMINAL_VELOCITY;
                }

                let hitSolid = false;
                const bottomY = Math.floor(ent.y + ent.height / 2);
                if (bottomY >= height - 1) {
                    hitSolid = true;
                    ent.y = height - 1 - ent.height / 2;
                } else {
                    const idx = bottomY * width + Math.floor(ent.x);
                    const tile = grid[idx];
                    if (properties[tile] && properties[tile].solid) hitSolid = true;
                }

                if (hitSolid) {
                    if (ent.vy > 0) { ent.vy = 0; ent.grounded = true; ent.y = Math.floor(ent.y); }
                } else {
                    ent.grounded = false;
                }
                ent.y += ent.vy;

                // Emitter Production (only for EMITTER and AC_EMITTER types)
                if (ent.type === 'EMITTER' || ent.type === 'AC_EMITTER') {
                    ent.productionTimer++;
                    if (ent.productionTimer >= ent.productionRate) {
                        ent.productionTimer = 0;
                        const cx = Math.floor(ent.x);
                        const cy = Math.floor(ent.y);
                        const r = Math.floor(ent.spawnRadius);

                        for (let dy = -r; dy <= r; dy++) {
                            for (let dx = -r; dx <= r; dx++) {
                                const sx = cx + dx;
                                const sy = cy + dy;
                                if (sx >= 0 && sx < width && sy >= 0 && sy < height) {
                                    const idx = sy * width + sx;
                                    const currentType = grid[idx];

                                    if (currentType === EMPTY) {
                                        grid[idx] = ent.spawnType;
                                        densityGrid[idx] += ent.spawnAmount;
                                    } else if (currentType === ent.spawnType) {
                                        densityGrid[idx] += ent.spawnAmount;
                                    } else if (properties[currentType].liquid) {
                                        densityGrid[idx] -= ent.spawnAmount;
                                        if (densityGrid[idx] <= 0) {
                                            grid[idx] = ent.spawnType;
                                            densityGrid[idx] = Math.abs(densityGrid[idx]);
                                        }
                                    }
                                }
                            }
                        }
                    }
                }

                // Spawner entities are now mineable resource nodes (no production logic needed)

                // Resource Miner Logic - mines spawner entities directly
                if (ent.type === 'RESOURCE_MINER') {
                    if (ent.built && apex && !apex.dead) {
                        // Find nearest SPAWNER entity within range
                        let nearestDist = ent.miningRange * ent.miningRange;
                        let targetSpawner = null;

                        for (let spawner of entities) {
                            if (spawner.type === 'SPAWNER' && !spawner.dead) {
                                const dx = spawner.x - ent.x;
                                const dy = spawner.y - ent.y;
                                const distSq = dx * dx + dy * dy;
                                if (distSq < nearestDist) {
                                    nearestDist = distSq;
                                    targetSpawner = spawner;
                                }
                            }
                        }

                        // Mine the spawner
                        if (targetSpawner) {
                            ent.targetResource = { x: targetSpawner.x, y: targetSpawner.y };

                            // Track collected resources
                            ent.resourceCollected += 5;

                            // Send packet to Apex every 10 units mined
                            if (ent.resourceCollected >= 10) {
                                packets.push(new Packet(ent.x, ent.y, apex, 'AC_RESOURCE', 10));
                                ent.resourceCollected -= 10;
                            }
                        } else {
                            ent.targetResource = null;
                        }
                    }
                }
            }
        }

        function checkLineOfSight(x0, y0, x1, y1, ignoreCreeper = false) {
            x0 = Math.floor(x0);
            y0 = Math.floor(y0);
            x1 = Math.floor(x1);
            y1 = Math.floor(y1);

            const dx = Math.abs(x1 - x0);
            const dy = Math.abs(y1 - y0);
            const sx = (x0 < x1) ? 1 : -1;
            const sy = (y0 < y1) ? 1 : -1;
            let err = dx - dy;

            while (true) {
                if (x0 === x1 && y0 === y1) break;

                const idx = y0 * width + x0;
                if (idx >= 0 && idx < grid.length) {
                    const type = grid[idx] & TYPE_MASK;
                    if (properties[type].solid) return false;
                    // If NOT ignoring creeper, and it IS creeper, block.
                    if (!ignoreCreeper && type === CREEPER) return false;
                }

                const e2 = 2 * err;
                if (e2 > -dy) { err -= dy; x0 += sx; }
                if (e2 < dx) { err += dx; y0 += sy; }
            }
            return true;
        }

        function updateNullifier(nullifier) {
            // Find Target
            let target = null;
            let minDist = nullifier.range;

            // Look for Emitters
            for (let e of entities) {
                if (e.type === 'EMITTER' && !e.dead) {
                    const d = Math.sqrt((e.x - nullifier.x) ** 2 + (e.y - nullifier.y) ** 2);
                    if (d <= nullifier.range) {
                        if (d < minDist) {
                            minDist = d;
                            target = e;
                        }
                    }
                }
            }

            nullifier.target = target;

            if (target) {
                // Check LOS (ignoring Creeper for Nullifiers)
                // We pass 'true' for ignoreLiquids (which we need to implement/verify in checkLineOfSight)
                // Actually checkLineOfSight signature is (x0, y0, x1, y1, ignoreLiquids)
                // Let's verify checkLineOfSight implementation first or just assume/update it.
                // But for now, let's pass true.
                const hasLOS = checkLineOfSight(nullifier.x, nullifier.y, target.x, target.y, true);

                if (hasLOS) {
                    nullifier.charge += 1.0 / 240.0; // 4 seconds
                    if (nullifier.charge >= 1.0) {
                        nullifier.charge = 1.0;
                        // FIRE
                        target.dead = true;
                        nullifier.dead = true; // Consumed
                        createExplosion(target.x, target.y, 20);
                        createExplosion(nullifier.x, nullifier.y, 10);
                    }
                } else {
                    nullifier.charge -= 1.0 / 480.0; // Discharge slowly
                }
            } else {
                nullifier.charge -= 1.0 / 480.0;
            }

            if (nullifier.charge < 0) nullifier.charge = 0;
        }

        function updateShipPhysics(ship) {
            // 1. Movement
            const dx = ship.targetX - ship.x;
            const dy = ship.targetY - ship.y;
            const dist = Math.sqrt(dx * dx + dy * dy);

            if (dist > 1) {
                const moveX = (dx / dist) * ship.moveSpeed;
                const moveY = (dy / dist) * ship.moveSpeed;
                ship.x += moveX;
                ship.y += moveY;
            }

            // 2. Death Collision
            // This logic is now handled in updateEntities for all ships
            // if (touchingCreeper) {
            //     ship.dead = true;
            //     createExplosion(cx, cy, 15, true); // Destroy terrain on ship death? Maybe not. Let's say yes for impact.
            //     return;
            // }

            // 2.5 Mining Logic (Apex Only)
            if (ship.type === 'APEX') {
                const r = ship.miningRange;
                const rSq = r * r;
                const startX = Math.floor(ship.x - r);
                const endX = Math.floor(ship.x + r);
                const startY = Math.floor(ship.y - r);
                const endY = Math.floor(ship.y + r);

                for (let y = startY; y <= endY; y++) {
                    for (let x = startX; x <= endX; x++) {
                        if (x >= 0 && x < width && y >= 0 && y < height) {
                            const idx = y * width + x;
                            if (grid[idx] & MARKED_MASK) {
                                const dSq = (x - ship.x) * (x - ship.x) + (y - ship.y) * (y - ship.y);
                                if (dSq <= rSq) {
                                    // Mine it!
                                    if (densityGrid[idx] <= 0) densityGrid[idx] = 100; // Lazy init for existing blocks
                                    densityGrid[idx] -= 5; // Damage rate

                                    if (densityGrid[idx] <= 0) {
                                        grid[idx] = EMPTY;
                                        densityGrid[idx] = 0;
                                    }
                                }
                            }
                        }
                    }
                }
            }

            // 3. Weapons
            ship.fireTimer++;
            if (ship.fireTimer >= ship.fireRate) {
                if (ship.type === 'APEX') {
                    // APEX (Missiles)
                    if (ship.power >= 50) { // Only fire if we have power
                        // Find Target
                        let maxDensity = 0;
                        let target = null;
                        const searchRadius = 150;
                        const cx = ship.x;
                        const cy = ship.y;

                        // Optimization: Check grid for Creeper
                        const startX = Math.floor(Math.max(0, cx - searchRadius));
                        const endX = Math.floor(Math.min(width, cx + searchRadius));
                        const startY = Math.floor(Math.max(0, cy - searchRadius));
                        const endY = Math.floor(Math.min(height, cy + searchRadius));

                        // Scan for Creeper
                        for (let y = startY; y < endY; y += 5) {
                            for (let x = startX; x < endX; x += 5) {
                                const idx = y * width + x;
                                const currentDensity = densityGrid[idx];

                                if ((grid[idx] & TYPE_MASK) === CREEPER && currentDensity > maxDensity) {
                                    const dSq = (x - cx) * (x - cx) + (y - cy) * (y - cy);
                                    if (dSq < searchRadius * searchRadius) {
                                        if (checkLineOfSight(cx, cy, x, y)) {
                                            maxDensity = currentDensity;
                                            target = { x, y };
                                        }
                                    }
                                }
                            }
                        }

                        if (target && maxDensity >= MISSILE_MIN_DENSITY_TARGET) {
                            const angleToTarget = Math.atan2(target.y - cy, target.x - cx);
                            const missileSpeed = 2.0;

                            // Launch Missile (isMissile: true)
                            projectiles.push(new Projectile(
                                cx, cy,
                                Math.cos(angleToTarget) * missileSpeed,
                                Math.sin(angleToTarget) * missileSpeed,
                                true
                            ));
                            ship.fireTimer = 0;
                            ship.power -= 50; // Consume Power
                        }
                    }
                } else if (ship.type === 'FIGHTER') {
                    // FIGHTER (Standard) - Needs Power
                    if (ship.power >= 10) { // Only fire if we have power

                        // Find Target
                        let nearestDist = Infinity;
                        let target = null;
                        const searchR = 120;
                        const cx = ship.x;
                        const cy = ship.y;

                        const startX = Math.floor(Math.max(0, cx - searchR));
                        const endX = Math.floor(Math.min(width, cx + searchR));
                        const startY = Math.floor(Math.max(0, cy - searchR));
                        const endY = Math.floor(Math.min(height, cy + searchR));

                        for (let y = startY; y < endY; y += 5) {
                            for (let x = startX; x < endX; x += 5) {
                                if ((grid[y * width + x] & TYPE_MASK) === CREEPER) {
                                    const d = (x - cx) * (x - cx) + (y - cy) * (y - cy);
                                    if (d < nearestDist) {
                                        if (checkLineOfSight(cx, cy, x, y)) {
                                            nearestDist = d;
                                            target = { x, y };
                                        }
                                    }
                                }
                            }
                        }

                        if (target && nearestDist < searchR * searchR) {
                            const angleToTarget = Math.atan2(target.y - cy, target.x - cx);
                            // Launch Standard Projectile
                            projectiles.push(new Projectile(
                                cx, cy,
                                Math.cos(angleToTarget) * PROJ_SPEED,
                                Math.sin(angleToTarget) * PROJ_SPEED,
                                false
                            ));
                            ship.fireTimer = 0;
                            ship.power -= 10; // Consume Power
                        }
                    }
                } else if (ship.type === 'SPRAYER') {
                    // SPRAYER (AC Particles)
                    const range = 150;
                    let nearestDist = Infinity;
                    let target = null;

                    const searchR = 150;
                    const cx = ship.x;
                    const cy = ship.y;
                    const startX = Math.floor(Math.max(0, cx - searchR));
                    const endX = Math.floor(Math.min(width, cx + searchR));
                    const startY = Math.floor(Math.max(0, cy - searchR));
                    const endY = Math.floor(Math.min(height, cy + searchR));

                    for (let y = startY; y < endY; y += 5) {
                        for (let x = startX; x < endX; x += 5) {
                            if ((grid[y * width + x] & TYPE_MASK) === CREEPER) {
                                const d = (x - cx) * (x - cx) + (y - cy) * (y - cy);
                                if (d < nearestDist) {
                                    if (checkLineOfSight(cx, cy, x, y)) {
                                        nearestDist = d;
                                        target = { x, y };
                                    }
                                }
                            }
                        }
                    }

                    // Firing Logic
                    let shouldFire = false;
                    let fireTarget = null;

                    if (target && nearestDist < range * range) {
                        shouldFire = true;
                        fireTarget = target;
                    } else if (ship.mode === 0) { // Always On
                        // Fire at move destination if no enemy
                        shouldFire = true;
                        fireTarget = { x: ship.targetX, y: ship.targetY };
                    }

                    // Check AC Ammo before firing
                    if (shouldFire && fireTarget && ship.acAmmo >= 5) {
                        const angleToTarget = Math.atan2(fireTarget.y - cy, fireTarget.x - cx);
                        // Spread
                        const spread = (Math.random() - 0.5) * 0.5;
                        const speed = PROJ_SPEED * 1.5;

                        projectiles.push(new Projectile(
                            cx, cy,
                            Math.cos(angleToTarget + spread) * speed,
                            Math.sin(angleToTarget + spread) * speed,
                            false,
                            true // isParticle
                        ));
                        ship.fireTimer = 0;
                        ship.acAmmo -= 5; // Consume AC ammo
                    }
                }
            }
        }

        // --- A* PATHFINDING FOR PACKETS ---
        function findPath(startX, startY, endX, endY) {
            // A* pathfinding with coarser grid for performance
            const gridStep = 2; // Use every 2nd pixel for pathfinding (faster)
            const start = { x: Math.floor(startX / gridStep), y: Math.floor(startY / gridStep) };
            const end = { x: Math.floor(endX / gridStep), y: Math.floor(endY / gridStep) };

            // Quick check if endpoints are valid
            const startWorldX = start.x * gridStep;
            const startWorldY = start.y * gridStep;
            const endWorldX = end.x * gridStep;
            const endWorldY = end.y * gridStep;

            if (startWorldX < 0 || startWorldX >= width || startWorldY < 0 || startWorldY >= height) return null;
            if (endWorldX < 0 || endWorldX >= width || endWorldY < 0 || endWorldY >= height) return null;

            const openSet = [start];
            const cameFrom = new Map();
            const gScore = new Map();
            const fScore = new Map();

            const key = (x, y) => y * 10000 + x; // Unique key for each grid position
            gScore.set(key(start.x, start.y), 0);
            fScore.set(key(start.x, start.y), heuristic(start, end));

            function heuristic(a, b) {
                // Manhattan distance
                return Math.abs(a.x - b.x) + Math.abs(a.y - b.y);
            }

            function isWalkable(x, y) {
                // Convert grid coords to world coords
                const worldX = x * gridStep;
                const worldY = y * gridStep;

                if (worldX < 0 || worldX >= width || worldY < 0 || worldY >= height) return false;

                // Check a small area around this grid point
                for (let dy = 0; dy < gridStep; dy++) {
                    for (let dx = 0; dx < gridStep; dx++) {
                        const checkX = worldX + dx;
                        const checkY = worldY + dy;
                        if (checkX >= width || checkY >= height) continue;

                        const idx = checkY * width + checkX;
                        const type = grid[idx] & TYPE_MASK;

                        // If any part of this grid cell is solid, it's not walkable
                        if (type !== EMPTY && properties[type] && properties[type].solid) {
                            return false;
                        }
                    }
                }
                return true;
            }

            // No iteration limit - runs until path found or openSet exhausted

            while (openSet.length > 0) {
                // Find node with lowest fScore
                let current = openSet[0];
                let currentIdx = 0;
                for (let i = 1; i < openSet.length; i++) {
                    if (fScore.get(key(openSet[i].x, openSet[i].y)) < fScore.get(key(current.x, current.y))) {
                        current = openSet[i];
                        currentIdx = i;
                    }
                }

                // Reached goal
                if (current.x === end.x && current.y === end.y) {
                    const path = [];
                    let temp = current;
                    while (temp) {
                        // Convert back to world coordinates
                        path.unshift({ x: temp.x * gridStep, y: temp.y * gridStep });
                        temp = cameFrom.get(key(temp.x, temp.y));
                    }
                    return path;
                }

                openSet.splice(currentIdx, 1);

                // Check neighbors (8-directional for smoother paths)
                const neighbors = [
                    { x: current.x + 1, y: current.y, cost: 1 },
                    { x: current.x - 1, y: current.y, cost: 1 },
                    { x: current.x, y: current.y + 1, cost: 1 },
                    { x: current.x, y: current.y - 1, cost: 1 },
                    { x: current.x + 1, y: current.y + 1, cost: 1.4 }, // Diagonal
                    { x: current.x + 1, y: current.y - 1, cost: 1.4 }, // Diagonal
                    { x: current.x - 1, y: current.y + 1, cost: 1.4 }, // Diagonal
                    { x: current.x - 1, y: current.y - 1, cost: 1.4 }  // Diagonal
                ];

                for (let neighbor of neighbors) {
                    if (!isWalkable(neighbor.x, neighbor.y)) continue;

                    const tentativeGScore = gScore.get(key(current.x, current.y)) + neighbor.cost;
                    const neighborKey = key(neighbor.x, neighbor.y);

                    if (!gScore.has(neighborKey) || tentativeGScore < gScore.get(neighborKey)) {
                        cameFrom.set(neighborKey, current);
                        gScore.set(neighborKey, tentativeGScore);
                        fScore.set(neighborKey, tentativeGScore + heuristic(neighbor, end));

                        if (!openSet.some(n => n.x === neighbor.x && n.y === neighbor.y)) {
                            openSet.push(neighbor);
                        }
                    }
                }
            }

            return null; // No path found
        }

        function updatePackets() {
            for (let i = packets.length - 1; i >= 0; i--) {
                let p = packets[i];
                if (p.target.dead || (p.type === 'BUILD' && p.target.built)) {
                    packets.splice(i, 1);
                    continue;
                }

                if (p.target && !p.target.dead) {
                    // Stuck detection - check if packet hasn't moved much
                    const movedDist = Math.sqrt((p.x - p.lastX) ** 2 + (p.y - p.lastY) ** 2);
                    if (movedDist < 1) {
                        p.stuckTimer++;
                        // If stuck for 60 frames (~1 second), recalculate path
                        if (p.stuckTimer > 60) {
                            p.path = null; // Force recalculation
                            p.stuckTimer = 0;
                        }
                    } else {
                        // Moving normally, reset stuck timer
                        p.stuckTimer = 0;
                        p.lastX = p.x;
                        p.lastY = p.y;
                    }

                    // Calculate path if we don't have one
                    if (!p.path) {
                        p.path = findPath(p.x, p.y, p.target.x, p.target.y);
                        p.pathIndex = 0;

                        // If no path found, packet cannot reach target - mark as dead
                        if (!p.path) {
                            p.dead = true;
                            continue;
                        }
                    }

                    // Follow the path
                    if (p.path && p.pathIndex < p.path.length) {
                        const waypoint = p.path[p.pathIndex];
                        const dx = waypoint.x - p.x;
                        const dy = waypoint.y - p.y;
                        const dist = Math.sqrt(dx * dx + dy * dy);

                        // Reached waypoint, move to next
                        if (dist < 2) {
                            p.pathIndex++;
                        } else {
                            // Move toward waypoint
                            p.x += (dx / dist) * p.speed;
                            p.y += (dy / dist) * p.speed;
                        }
                    }

                    // Check if we've reached the final target
                    const finalDx = p.target.x - p.x;
                    const finalDy = p.target.y - p.y;
                    const finalDist = Math.sqrt(finalDx * finalDx + finalDy * finalDy);

                    if (finalDist < p.speed) {
                        // Arrived at target
                        if (p.type === 'BUILD') {
                            p.target.buildProgress += p.value;
                            if (p.target.buildProgress >= p.target.buildReq) {
                                p.target.built = true;
                                p.target.buildProgress = p.target.buildReq;
                            }
                        } else if (p.type === 'POWER') {
                            p.target.power = Math.min(p.target.maxPower, p.target.power + p.value);
                        } else if (p.type === 'AC_RESOURCE') {
                            // Resource packet to Apex
                            if (p.target.type === 'APEX') {
                                p.target.acResource += p.value;
                            }
                        } else if (p.type === 'AC_AMMO') {
                            // AC ammo packet to Sprayer
                            if (p.target.type === 'SPRAYER') {
                                p.target.acAmmo = Math.min(p.target.maxAcAmmo, p.target.acAmmo + p.value);
                            }
                        } else if (p.type === 'REPAIR') {
                            // Repair packet to any ship
                            p.target.health = Math.min(p.target.maxHealth, p.target.health + p.value);
                        }
                        p.dead = true;
                    }
                } else {
                    p.dead = true;
                }
            }
            packets = packets.filter(p => !p.dead);
        }

        function createExplosion(cx, cy, radius, destroyTerrain = false) {
            const rSq = radius * radius;
            const startX = Math.floor(cx - radius);
            const endX = Math.floor(cx + radius);
            const startY = Math.floor(cy - radius);
            const endY = Math.floor(cy + radius);

            for (let y = startY; y <= endY; y++) {
                for (let x = startX; x <= endX; x++) {
                    if (x >= 0 && x < width && y >= 0 && y < height) {
                        const distSq = (x - cx) * (x - cx) + (y - cy) * (y - cy);
                        if (distSq <= rSq) {
                            const idx = y * width + x;
                            const type = grid[idx] & TYPE_MASK;
                            if (destroyTerrain) {
                                if (type !== WALL) {
                                    grid[idx] = EMPTY;
                                    densityGrid[idx] = 0;
                                }
                            } else {
                                // Only destroy liquids
                                if (type === CREEPER || type === ANTI_CREEPER) {
                                    grid[idx] = EMPTY;
                                    densityGrid[idx] = 0;
                                }
                            }
                        }
                    }
                }
            }
        }

        function updateProjectiles() {
            for (let i = projectiles.length - 1; i >= 0; i--) {
                let p = projectiles[i];
                p.x += p.vx;
                p.y += p.vy;
                p.life--;

                if (p.x < 0 || p.x >= width || p.y < 0 || p.y >= height || p.life <= 0) {
                    projectiles.splice(i, 1);
                    continue;
                }

                const idx = Math.floor(p.y) * width + Math.floor(p.x);
                const tile = grid[idx] & TYPE_MASK;

                if (p.isParticle) {
                    // Particle Logic
                    if (tile !== EMPTY && tile !== AC_PARTICLE) {
                        // Hit something solid/liquid
                        // Convert to AC Particle at previous pos (or current if valid)
                        let px = Math.floor(p.x - p.vx);
                        let py = Math.floor(p.y - p.vy);
                        if (px < 0 || px >= width || py < 0 || py >= height) { px = Math.floor(p.x); py = Math.floor(p.y); }

                        const pIdx = py * width + px;
                        if ((grid[pIdx] & TYPE_MASK) === EMPTY) {
                            grid[pIdx] = AC_PARTICLE;
                            densityGrid[pIdx] = 100; // Health/Mass
                        }
                        projectiles.splice(i, 1);
                    }
                    else if (p.life < 10) {
                        // End of life, drop as particle
                        const pIdx = idx;
                        if ((grid[pIdx] & TYPE_MASK) === EMPTY) {
                            grid[pIdx] = AC_PARTICLE;
                            densityGrid[pIdx] = 100;
                        }
                        projectiles.splice(i, 1);
                    }
                } else {
                    // Standard Projectile Logic
                    if (properties[tile].solid || tile === CREEPER) {
                        // Use the projectile's stored explosionRadius
                        createExplosion(p.x, p.y, p.explosionRadius, false); // False = Don't destroy terrain
                        projectiles.splice(i, 1);
                    }
                }
            }
        }

        function updateGrid() {
            frameCount++;
