            for (let y = height - 1; y >= 0; y--) {
                const startX = frameCount % 2 === 0 ? 0 : width - 1;
                const endX = frameCount % 2 === 0 ? width : -1;
                const stepX = frameCount % 2 === 0 ? 1 : -1;

                for (let x = startX; x !== endX; x += stepX) {
                    const idx = y * width + x;
                    const type = grid[idx] & TYPE_MASK;
                    let density = densityGrid[idx];

                    if (type === EMPTY || type === WALL || type === DIRT || type === BEDROCK || type === STONE) continue;

                    // --- SOLID PHYSICS (Sand, AC Particles, AC Resources) ---
                    if (type === SAND || type === AC_PARTICLE || type === AC_RESOURCE) {

                        // AC Particle Reaction
                        if (type === AC_PARTICLE) {
                            const neighbors = [(y) * width + (x + 1), (y) * width + (x - 1), (y + 1) * width + x, (y - 1) * width + x];
                            let reacted = false;
                            for (let nIdx of neighbors) {
                                if (nIdx >= 0 && nIdx < grid.length) {
                                    const nType = grid[nIdx] & TYPE_MASK;
                                    if (nType !== EMPTY && nType !== AC_PARTICLE) {
                                        // React!
                                        grid[idx] = ANTI_CREEPER;
                                        densityGrid[idx] = AC_PARTICLE_AMOUNT;
                                        reacted = true;
                                        break;
                                    }
                                }
                            }
                            if (reacted) continue;
                        }

                        const downIdx = (y + 1) * width + x;
                        if (y + 1 < height) {
                            if ((grid[downIdx] & TYPE_MASK) === EMPTY || (properties[grid[downIdx] & TYPE_MASK].liquid)) {
                                const tempType = grid[downIdx];
                                const tempDens = densityGrid[downIdx];
                                grid[downIdx] = grid[idx]; // Move with flags
                                densityGrid[downIdx] = density;
                                grid[idx] = tempType;
                                densityGrid[idx] = tempDens;
                                continue;
                            }
                        }
                        continue;
                    }

                    // --- LIQUID PHYSICS ---
                    if (properties[type].liquid) {
                        // 1a. CREEPER/AC ANNIHILATION
                        if (type === CREEPER || type === ANTI_CREEPER) {
                            const enemy = (type === CREEPER) ? ANTI_CREEPER : CREEPER;
                            // Check left, right, and up first (not down - allow flow before annihilation)
                            const neighbors = [(y) * width + (x + 1), (y) * width + (x - 1), (y - 1) * width + x];
                            let interaction = false;
                            for (let nIdx of neighbors) {
                                if (nIdx >= 0 && nIdx < grid.length && (grid[nIdx] & TYPE_MASK) === enemy) {
                                    const damage = Math.min(densityGrid[idx], densityGrid[nIdx], 2.0);
                                    densityGrid[idx] -= damage;
                                    densityGrid[nIdx] -= damage;

                                    if (densityGrid[nIdx] <= 0) {
                                        grid[nIdx] = EMPTY;
                                        densityGrid[nIdx] = 0;
                                    }
                                    if (densityGrid[idx] <= 0) {
                                        grid[idx] = EMPTY;
                                        densityGrid[idx] = 0;
                                        interaction = true;
                                        break;
                                    }
                                }
                            }
                            if (interaction) continue;
                        }

                        // 1b. WATER/LAVA INTERACTION (Make Stone + Steam)
                        if (type === WATER || type === LAVA) {
                            const enemy = (type === WATER) ? LAVA : WATER;
                            const neighbors = [(y) * width + (x + 1), (y) * width + (x - 1), (y - 1) * width + x, (y + 1) * width + x];
                            let reacted = false;
                            for (let nIdx of neighbors) {
                                if (nIdx >= 0 && nIdx < grid.length && (grid[nIdx] & TYPE_MASK) === enemy) {
                                    // Turn into STONE
                                    grid[idx] = STONE;
                                    densityGrid[idx] = 100;
                                    // Turn neighbor into STONE
                                    grid[nIdx] = STONE;
                                    densityGrid[nIdx] = 100;

                                    // Create STEAM above
                                    const upIdx = (y - 1) * width + x;
                                    if (upIdx >= 0 && (grid[upIdx] & TYPE_MASK) === EMPTY) {
                                        grid[upIdx] = STEAM;
                                        densityGrid[upIdx] = 50;
                                    }

                                    reacted = true;
                                    break;
                                }
                            }
                            if (reacted) continue;
                        }
                    }

                    // 2. MOVEMENT & PRESSURE
                    let moved = false;
                    const downIdx = (y + 1) * width + x;
                    if (y + 1 < height) {
                        const downType = grid[downIdx] & TYPE_MASK;
                        if (downType === EMPTY) {
                            grid[downIdx] = grid[idx]; // Move with flags
                            densityGrid[downIdx] = density;
                            grid[idx] = EMPTY;
                            densityGrid[idx] = 0;
                            continue;
                        }
                        else if (downType === type) {
                            const spaceBelow = 1.0 - densityGrid[downIdx];
                            if (spaceBelow > 0.05) {
                                const amount = Math.min(density, spaceBelow);
                                densityGrid[downIdx] += amount;
                                densityGrid[idx] -= amount;
                                density = densityGrid[idx];
                                if (density <= 0.01) {
                                    grid[idx] = EMPTY;
                                    densityGrid[idx] = 0;
                                    continue;
                                }
                            }
                        }
                    }

                    // Pressure Expansion
                    if (density > 1.0) {
                        const excess = density - 1.0;
                        const spreadAmount = excess * 0.5;
                        const dirs = [1, -1];
                        if (Math.random() > 0.5) dirs.reverse();
                        if (density > 2.0) dirs.push(0);

                        for (let dir of dirs) {
                            let nIdx;
                            if (dir === 0) nIdx = (y - 1) * width + x;
                            else nIdx = y * width + (x + dir);

                            if (nIdx >= 0 && nIdx < grid.length) {
                                const nType = grid[nIdx] & TYPE_MASK;
                                if (nType === EMPTY) {
                                    grid[nIdx] = grid[idx]; // Spread with flags
                                    densityGrid[nIdx] += spreadAmount;
                                    densityGrid[idx] -= spreadAmount;
                                    density = densityGrid[idx];
                                    moved = true;
                                    break;
                                }
                                else if (nType === type) {
                                    // Equalize density with neighbor (like water finding level)
                                    const avgDensity = (densityGrid[nIdx] + densityGrid[idx]) / 2;
                                    const diff = Math.abs(densityGrid[idx] - avgDensity);

                                    // Only equalize if difference is significant
                                    if (diff > 0.1) {
                                        const transfer = (densityGrid[idx] - avgDensity) * 0.5; // Transfer half the difference
                                        densityGrid[nIdx] += transfer;
                                        densityGrid[idx] -= transfer;
                                        density = densityGrid[idx];
                                        moved = true;
                                        break;
                                    }
                                }
                            }
                        }
                    }

                    // GAS PHYSICS (Steam) - Rises
                    if (properties[type].gas) {
                        // Try to move UP
                        const upIdx = (y - 1) * width + x;
                        if (y > 0) {
                            const upType = grid[upIdx] & TYPE_MASK;
                            if (upType === EMPTY || (properties[upType].liquid)) {
                                // Swap with empty or liquid (bubble up)
                                const tempType = grid[upIdx];
                                const tempDens = densityGrid[upIdx];
                                grid[upIdx] = grid[idx];
                                densityGrid[upIdx] = density;
                                grid[idx] = tempType;
                                densityGrid[idx] = tempDens;
                                continue;
                            }
                        }
                        // Spread Horizontal if blocked
                        const dir = Math.random() < 0.5 ? -1 : 1;
                        const sideIdx = y * width + (x + dir);
                        if (x + dir >= 0 && x + dir < width && (grid[sideIdx] & TYPE_MASK) === EMPTY) {
                            grid[sideIdx] = grid[idx];
                            densityGrid[sideIdx] = density;
                            grid[idx] = EMPTY;
                            densityGrid[idx] = 0;
                        }
                        continue;
                    }

                    // Natural Sliding
                    if (!moved && density > 0.01) {
                        const dir = Math.random() < 0.5 ? -1 : 1;
                        const sideIdx = y * width + (x + dir);
                        if (x + dir >= 0 && x + dir < width) {
                            if ((grid[sideIdx] & TYPE_MASK) === EMPTY) {
                                grid[sideIdx] = grid[idx]; // Slide with flags
                                densityGrid[sideIdx] = density;
                                grid[idx] = EMPTY;
                                densityGrid[idx] = 0;
                            } else if ((grid[sideIdx] & TYPE_MASK) === type && densityGrid[sideIdx] < density - 0.5) {
                                const flow = (density - densityGrid[sideIdx]) * 0.1;
                                densityGrid[sideIdx] += flow;
                                densityGrid[idx] -= flow;
                            }
                        }
                    }
                }
            }
        }

        // --- RENDERING ---
        function draw() {
            let totalCreeper = 0;
            let totalAC = 0;

            // 1. Draw Pixel Grid
            for (let i = 0; i < grid.length; i++) {
                const rawType = grid[i];
                const type = rawType & TYPE_MASK;
                const marked = (rawType & MARKED_MASK) !== 0;

                if (type === EMPTY) {
                    buf32[i] = 0xff000000;
                    continue;
                }
                const props = properties[type];
                let r = props.color[0], g = props.color[1], b = props.color[2];

                if (marked) {
                    // Green tint for marked terrain
                    g = Math.min(255, g + 100);
                }

                if (props.solid) {
                    // Visualize Damage
                    const health = densityGrid[i];
                    if (health > 0 && health < 100) {
                        const darken = (100 - health) / 100; // 0 to 1
                        const factor = 1 - darken * 0.6;
                        r *= factor;
                        g *= factor;
                        b *= factor;
                    }
                }

                if (props.liquid) {
                    const dens = densityGrid[i];
                    if (type === CREEPER) {
                        totalCreeper += dens;
                        const intensity = Math.min(1.0, dens / 5.0);
                        r *= intensity; g *= intensity; b = 255 * intensity; // Blue scale
                    } else if (type === ANTI_CREEPER) {
                        totalAC += dens;
                        const intensity = Math.min(1.0, dens / 5.0);
                        r = 220 * intensity; g = 220 * intensity; b = 255 * intensity;
                    }
                }
                // Removed texture noise to prevent shimmer
                buf32[i] = (255 << 24) | (b << 16) | (g << 8) | r;
            }
            ctx.putImageData(imgData, 0, 0);

            // Update Stats UI
            const maxVal = Math.max(totalCreeper, totalAC, 1000); // Min 1000 to avoid div/0 or jumpy bars
            document.getElementById('val-creeper').innerText = Math.floor(totalCreeper);
            document.getElementById('val-ac').innerText = Math.floor(totalAC);
            document.getElementById('bar-creeper').style.width = `${(totalCreeper / maxVal) * 100}%`;
            document.getElementById('bar-ac').style.width = `${(totalAC / maxVal) * 100}%`;

            // Update Apex Power Bar
            const apex = entities.find(e => e.type === 'APEX');
            if (apex) {
                const pct = (apex.power / apex.maxPower) * 100;
                document.getElementById('power-bar-fill').style.width = `${pct}%`;
                document.getElementById('power-text').innerText = `Apex Power: ${Math.floor(apex.power)} / ${apex.maxPower}`;
            }

            // 2. Draw Projectiles
            for (let p of projectiles) {
                if (p.isMissile) {
                    ctx.fillStyle = '#ff4757'; // Red for Missile
                    ctx.fillRect(Math.floor(p.x) - 1, Math.floor(p.y) - 1, 3, 3);
                } else if (p.isParticle) {
                    ctx.fillStyle = '#00d2d3'; // Cyan for Particle
                    ctx.fillRect(Math.floor(p.x), Math.floor(p.y), 2, 2);
                } else {
                    ctx.fillStyle = '#ffeaa7'; // Yellow for Standard Projectile
                    ctx.fillRect(Math.floor(p.x), Math.floor(p.y), 2, 2);
                }
            }

            // 3. Draw Packets
            for (let p of packets) {
                if (p.type === 'POWER') {
                    ctx.fillStyle = '#f1c40f'; // Yellow/Orange for Power
                } else if (p.type === 'AC_RESOURCE') {
                    ctx.fillStyle = '#ff69b4'; // Pink for AC Resource
                } else if (p.type === 'AC_AMMO') {
                    ctx.fillStyle = '#00d2d3'; // Cyan for AC Ammo
                } else {
                    ctx.fillStyle = '#fff'; // White for Build
                }
                ctx.fillRect(Math.floor(p.x), Math.floor(p.y), 2, 2);
            }

            // 4. Draw Build Range (if constructing)
            if (currentTool === 'build_fighter' || currentTool === 'build_nullifier' || currentTool === 'build_sprayer' || currentTool === 'build_miner') {
                const apexEntity = entities.find(e => e.type === 'APEX');
                if (apexEntity) {
                    ctx.beginPath();
                    ctx.arc(apexEntity.x, apexEntity.y, BUILD_RANGE, 0, Math.PI * 2);
                    ctx.strokeStyle = 'rgba(85, 239, 196, 0.2)';
                    ctx.setLineDash([5, 5]);
                    ctx.lineWidth = 1;
                    ctx.stroke();
                    ctx.setLineDash([]);
                }
            }

            // Draw Mining Range (Apex)
            if (apex) {
                ctx.beginPath();
                ctx.arc(apex.x, apex.y, apex.miningRange, 0, Math.PI * 2);
                ctx.strokeStyle = 'rgba(0, 184, 148, 0.2)'; // Green mining circle
                ctx.lineWidth = 1;
                ctx.stroke();
            }

            // 5. Draw Entities
            for (let ent of entities) {
                const cx = ent.x;
                const cy = ent.y;

                if (ent.type === 'APEX' || ent.type === 'FIGHTER' || ent.type === 'SPRAYER') {
                    ctx.save();
                    ctx.translate(cx, cy);

                    if (!ent.built) {
                        ctx.globalAlpha = 0.5; // Ghost
                    }

                    if (ent.type === 'APEX') {
                        // Apex Body
                        ctx.fillStyle = '#fdcb6e'; // Gold (Master Ship)
                        ctx.fillRect(-5, -7, 10, 14); // Adjusted height
                        ctx.fillStyle = '#fff';
                        ctx.fillRect(-2, -2, 4, 4);
                        // Missile Launcher detail
                        ctx.fillStyle = '#ff4757';
                        ctx.fillRect(-6, -3, 2, 6);
                        ctx.fillRect(4, -3, 2, 6);
                    } else if (ent.type === 'FIGHTER') {
                        // Fighter Body
                        ctx.fillStyle = '#fab1a0'; // Light Red/Orange (Fighter)
                        ctx.fillRect(-3, -3, 6, 6);
                        // Single Gun
                        ctx.fillStyle = '#fff';
                        ctx.fillRect(-1, -4, 2, 3);
                    } else if (ent.type === 'SPRAYER') {
                        // Sprayer Body
                        ctx.fillStyle = '#74b9ff'; // Blue
                        ctx.fillRect(-3, -3, 6, 6);
                        // Nozzle
                        ctx.fillStyle = '#fff';
                        ctx.fillRect(-1, -5, 2, 4);
                    }

                    // Build Progress Bar
                    if (!ent.built) {
                        ctx.fillStyle = '#555';
                        ctx.fillRect(-5, -10, 10, 2);
                        ctx.fillStyle = '#0f0';
                        ctx.fillRect(-5, -10, 10 * (ent.buildProgress / ent.buildReq), 2);
                    }

                    // Power Bar (if built and uses power)
                    if (ent.built && ent.maxPower > 0) {
                        ctx.fillStyle = '#555';
                        ctx.fillRect(-5, -8, 10, 2);
                        ctx.fillStyle = '#f1c40f'; // Yellow
                        ctx.fillRect(-5, -8, 10 * (ent.power / ent.maxPower), 2);
                    }

                    // AC Ammo Bar (for sprayers)
                    if (ent.type === 'SPRAYER' && ent.built) {
                        ctx.fillStyle = '#333';
                        ctx.fillRect(-5, -11, 10, 2);
                        ctx.fillStyle = '#00d2d3'; // Cyan for AC
                        ctx.fillRect(-5, -11, 10 * (ent.acAmmo / ent.maxAcAmmo), 2);
                    }

                    // Draw Health Bar for all ships
                    if (ent.built && ent.maxHealth > 0 && ent.health < ent.maxHealth) {
                        const barWidth = ent.width + 4;
                        const barHeight = 3;
                        const hpPct = Math.max(0, ent.health / ent.maxHealth);

                        ctx.fillStyle = '#000';
                        ctx.fillRect(-barWidth / 2, -ent.height / 2 - 8, barWidth, barHeight);

                        ctx.fillStyle = hpPct > 0.5 ? '#00b894' : '#d63031';
                        ctx.fillRect(-barWidth / 2, -ent.height / 2 - 8, barWidth * hpPct, barHeight);
                    }

                    // Selection
                    if (ent === selectedEntity) {
                        ctx.strokeStyle = '#55efc4';
                        ctx.lineWidth = 1;
                        ctx.beginPath();
                        ctx.arc(0, 0, ent.width + 2, 0, Math.PI * 2);
                        ctx.stroke();

                        if (ent.targetX !== ent.x || ent.targetY !== ent.y) {
                            ctx.restore();
                            ctx.beginPath();
                            ctx.moveTo(cx, cy);
                            ctx.lineTo(ent.targetX, ent.targetY);
                            ctx.strokeStyle = 'rgba(85, 239, 196, 0.3)';
                            ctx.setLineDash([2, 2]);
                            ctx.stroke();
                            ctx.setLineDash([]);
                            ctx.save();
                        }
                    }
                    ctx.restore();

                } else if (ent.type === 'NULLIFIER') {
                    ctx.save();
                    ctx.translate(cx, cy);

                    if (!ent.built) ctx.globalAlpha = 0.5;

                    // Body
                    ctx.fillStyle = '#a29bfe';
                    ctx.fillRect(-3, -3, 6, 6);
                    ctx.strokeStyle = '#fff';
                    ctx.lineWidth = 1;
                    ctx.strokeRect(-3, -3, 6, 6);

                    // Charge Indicator
                    if (ent.built) {
                        ctx.fillStyle = '#fff';
                        const h = ent.charge * 6;
                        ctx.fillRect(-3, 3 - h, 6, h);
                    }

                    // Build Progress
                    if (!ent.built) {
                        ctx.fillStyle = '#000';
                        ctx.fillRect(-5, 6, 10, 2);
                        ctx.fillStyle = '#00b894';
                        const pct = ent.buildProgress / ent.buildReq;
                        ctx.fillRect(-5, 6, 10 * pct, 2);
                    }

                    // Beam
                    if (ent.built && ent.target && ent.charge > 0) {
                        ctx.restore(); // Go back to world coords
                        ctx.beginPath();
                        ctx.moveTo(ent.x, ent.y);
                        ctx.lineTo(ent.target.x, ent.target.y);
                        ctx.strokeStyle = `rgba(255, 255, 255, ${ent.charge})`;
                        ctx.lineWidth = 1 + ent.charge * 3;
                        ctx.stroke();
                        ctx.save(); // Just to match the restore below
                    }

                    // Range Circle (when selected)
                    if (ent === selectedEntity && ent.built) {
                        ctx.restore(); // Go back to world coords
                        ctx.beginPath();
                        ctx.arc(ent.x, ent.y, NULLIFIER_RANGE, 0, Math.PI * 2);
                        ctx.strokeStyle = 'rgba(162, 155, 254, 0.5)';
                        ctx.lineWidth = 2;
                        ctx.setLineDash([5, 5]);
                        ctx.stroke();
                        ctx.setLineDash([]);
                        ctx.save(); // Match the restore below
                    }

                    ctx.restore();

                } else if (ent.type === 'SPAWNER') {
                    // Draw Spawner
                    ctx.fillStyle = '#00b894'; // Teal/Green
                    ctx.fillRect(cx - 4, cy - 4, 8, 8);
                    const pulse = Math.sin(frameCount * 0.15) * 50 + 200;
                    ctx.fillStyle = `rgb(50, ${pulse}, 150)`;
                    ctx.fillRect(cx - 2, cy - 2, 4, 4);

                    if (ent === selectedEntity) {
                        ctx.strokeStyle = '#00cec9';
                        ctx.lineWidth = 1;
                        ctx.strokeRect(cx - 5, cy - 5, 10, 10);
                    }

                } else if (ent.type === 'RESOURCE_MINER') {
                    // Draw Resource Miner
                    ctx.save();
                    ctx.translate(cx, cy);

                    if (!ent.built) ctx.globalAlpha = 0.5;

                    //Body
                    ctx.fillStyle = '#d63031'; // Orange/brown
                    ctx.fillRect(-3, -3, 6, 6);
                    // Drill detail
                    ctx.fillStyle = '#636e72';
                    ctx.fillRect(-1, -4, 2, 3);

                    // Build Progress
                    if (!ent.built) {
                        ctx.fillStyle = '#000';
                        ctx.fillRect(-5, 6, 10, 2);
                        ctx.fillStyle = '#ff69b4'; // Pink
                        const pct = ent.buildProgress / ent.buildReq;
                        ctx.fillRect(-5, 6, 10 * pct, 2);
                    }

                    // Mining Beam
                    if (ent.built && ent.targetResource) {
                        ctx.restore(); // Go back to world coords
                        ctx.beginPath();
                        ctx.moveTo(ent.x, ent.y);
                        ctx.lineTo(ent.targetResource.x, ent.targetResource.y);
                        ctx.strokeStyle = 'rgba(255, 105, 180, 0.6)'; // Pink beam
                        ctx.lineWidth = 2;
                        ctx.stroke();
                        ctx.save(); // Match the restore below
                    }

                    // Selection
                    if (ent === selectedEntity) {
                        ctx.strokeStyle = '#d63031';
                        ctx.lineWidth = 1;
                        ctx.beginPath();
                        ctx.arc(0, 0, 5, 0, Math.PI * 2);
                        ctx.stroke();

                        // Show mining range
                        ctx.restore();
                        ctx.beginPath();
                        ctx.arc(ent.x, ent.y, ent.miningRange, 0, Math.PI * 2);
                        ctx.strokeStyle = 'rgba(214, 48, 49, 0.3)'; // Orange mining circle
                        ctx.lineWidth = 1;
                        ctx.stroke();
                        ctx.save();
                    }

                    ctx.restore();

                } else {
                    // Draw Emitter
                    ctx.fillStyle = ent.type === 'AC_EMITTER' ? '#dfe6e9' : '#444';
                    ctx.fillRect(cx - 3, cy - 3, 6, 6);
                    const pulse = Math.sin(frameCount * 0.2) * 50 + 200;
                    ctx.fillStyle = ent.type === 'AC_EMITTER'
                        ? `rgb(50, 50, ${pulse})`
                        : `rgb(${pulse}, 50, 50)`;
                    ctx.fillRect(cx - 1, cy - 1, 2, 2);

                    if (ent === selectedEntity) {
                        ctx.strokeStyle = '#ffeaa7';
                        ctx.lineWidth = 1;
                        ctx.strokeRect(cx - 4, cy - 4, 8, 8);
                        ctx.beginPath();
                        ctx.arc(cx, cy, ent.spawnRadius, 0, Math.PI * 2);
                        ctx.strokeStyle = 'rgba(255, 255, 255, 0.3)';
                        ctx.stroke();
                    }
                }
            }
        }

        function loop() {
            // Always update tutorial to check for triggers/unpause
            tutorialManager.update();

            if (!isPaused && !tutorialManager.pauseGame) {
                updateEntities();
                updatePackets();
                updateProjectiles();
                updateGrid();
                checkVictory();
            }
            draw();
            requestAnimationFrame(loop);
        }

        function togglePause() {
            isPaused = !isPaused;
            const btn = document.getElementById('btn-play-pause');
            if (btn) btn.innerText = isPaused ? '‚ñ∂Ô∏è' : '‚è∏Ô∏è';
        }

        // --- TUTORIAL SYSTEM ---
        const tutorialOverlay = document.getElementById('tutorial-overlay');
        const tutorialText = document.getElementById('tutorial-text');
        const tutorialNextBtn = document.getElementById('tutorial-next-btn');

        class TutorialManager {
            constructor() {
                this.active = false;
                this.steps = [];
                this.currentStepIndex = 0;
                this.waitingForAction = false;
                this.highlightTarget = null; // Entity type or specific entity
                this.uiHighlight = null; // DOM ID
                this.pauseGame = false;
                this.forceInteraction = null; // DOM ID or 'canvas'

                this.handleInteraction = this.handleInteraction.bind(this);
            }

            start(levelId) {
                this.steps = this.getStepsForLevel(levelId);
                if (this.steps.length > 0) {
                    this.active = true;
                    this.currentStepIndex = 0;
                    // Add capture listener to block interactions
                    window.addEventListener('click', this.handleInteraction, true);
                    window.addEventListener('mousedown', this.handleInteraction, true);
                    this.showStep();
                } else {
                    this.end();
                }
            }

            end() {
                this.active = false;
                this.clearHighlights();
                tutorialOverlay.style.display = 'none';
                window.removeEventListener('click', this.handleInteraction, true);
                window.removeEventListener('mousedown', this.handleInteraction, true);

                // Unpause if we were pausing
                if (this.pauseGame) {
                    this.pauseGame = false;
                    // Only unpause if we are in play mode and it makes sense
                    if (gameMode === 'play' && isPaused) {
                        isPaused = false;
                        const btn = document.getElementById('btn-play-pause');
                        if (btn) btn.innerText = '‚è∏Ô∏è';
                    }
                }
            }

            handleInteraction(e) {
                if (!this.active) return;

                const step = this.steps[this.currentStepIndex];
                if (!step) return;

                // Always allow the Next button
                if (e.target === tutorialNextBtn) return;

                // If step requires specific interaction
                if (step.forceInteraction) {
                    let allowed = false;
                    let target = e.target;

                    if (step.forceInteraction === 'canvas') {
                        if (target.tagName === 'CANVAS') allowed = true;
                    } else {
                        // Traverse up to find button or relevant element
                        while (target && target !== document.body) {
                            if (target.id === step.forceInteraction) {
                                allowed = true;
                                break;
                            }
                            target = target.parentElement;
                        }
                    }

                    if (!allowed) {
                        e.stopPropagation();
                        e.preventDefault();
                        e.stopImmediatePropagation();
                    }
                }
            }

            getStepsForLevel(levelId) {
                if (levelId === 1) {
                    return [
                        {
                            text: "Welcome to WooGame! Your goal is to destroy all Emitters.",
                            trigger: "click",
                            pauseGame: true
                        },
                        {
                            text: "This is your Apex Ship (gold). It generates power and builds units.",
                            trigger: "click",
                            highlightTarget: "APEX",
                            pauseGame: true
                        },
                        {
                            text: "Select the 'Select' tool from the toolbar.",
                            trigger: "tool_select",
                            targetTool: "select",
                            uiHighlight: "btn-select",
                            forceInteraction: "btn-select",
                            pauseGame: true
                        },
                        {
                            text: "Now click on the Apex Ship to select it.",
                            trigger: "selection",
                            targetType: "APEX",
                            highlightTarget: "APEX",
                            forceInteraction: "canvas"
                        },
                        {
                            text: "With the Apex Ship selected, click anywhere on the map to move it.",
                            trigger: "movement",
                            targetType: "APEX",
                            highlightTarget: "APEX"
                        },
                        {
                            text: "See that red Emitter? It produces Creeper (blue liquid).",
                            trigger: "click",
                            highlightTarget: "EMITTER",
                            pauseGame: true
                        },
                        {
                            text: "We need to destroy it. First, let's build a Nullifier. Select the 'Nullifier' tool.",
                            trigger: "tool_select",
                            targetTool: "build_nullifier",
                            uiHighlight: "btn-build-nullifier",
                            forceInteraction: "btn-build-nullifier",
                            pauseGame: true
                        },
                        {
                            text: "Nullifiers must be built within range of the Apex Ship (dotted circle). Place one near the Emitter.",
                            trigger: "build",
                            targetType: "NULLIFIER",
                            forceInteraction: "canvas",
                            highlightTarget: "APEX"
                        },
                        {
                            text: "Good! Now we need weapons to protect it. Select the 'Fighter' tool.",
                            trigger: "tool_select",
                            targetTool: "build_fighter",
                            uiHighlight: "btn-build-fighter",
                            forceInteraction: "btn-build-fighter"
                        },
                        {
                            text: "Build a Fighter near the Nullifier to clear the Creeper.",
                            trigger: "build",
                            targetType: "FIGHTER",
                            forceInteraction: "canvas"
                        },
                        {
                            text: "The Nullifier will charge up and destroy the Emitter when close enough. Protect it!",
                            trigger: "click"
                        },
                        {
                            text: "Good luck, Commander!",
                            trigger: "click"
                        }
                    ];
                }
                return [];
            }

            showStep() {
                if (this.currentStepIndex >= this.steps.length) {
                    this.end();
                    return;
                }

                const step = this.steps[this.currentStepIndex];
                tutorialText.innerText = step.text;
                tutorialOverlay.style.display = 'block';

                // Handle Pausing
                this.pauseGame = !!step.pauseGame;
                // If we just paused, update global state if needed, but we handle logic in loop()
                // Actually, we should sync global isPaused if we want to stop physics
                if (this.pauseGame) {
                    // We don't change global isPaused because that changes UI button
                    // We'll handle it in loop()
                }

                // Handle UI Highlight
                this.clearHighlights();
                if (step.uiHighlight) {
                    const el = document.getElementById(step.uiHighlight);
                    if (el) el.classList.add('tutorial-highlight-ui');
                }

                // Handle World Highlight
                this.highlightTarget = step.highlightTarget || null;

                if (step.trigger === 'click') {
                    tutorialNextBtn.style.display = 'block';
                    tutorialNextBtn.onclick = () => this.nextStep();
                    this.waitingForAction = false;
                } else {
                    tutorialNextBtn.style.display = 'none';
                    this.waitingForAction = true;
                }
            }

            clearHighlights() {
                const highlighted = document.querySelectorAll('.tutorial-highlight-ui');
                highlighted.forEach(el => el.classList.remove('tutorial-highlight-ui'));
                this.highlightTarget = null;
            }

            nextStep() {
                this.currentStepIndex++;
                this.showStep();
            }

            update() {
                if (!this.active || !this.waitingForAction) return;

                const step = this.steps[this.currentStepIndex];

                if (step.trigger === 'selection') {
                    if (selectedEntity && selectedEntity.type === step.targetType) {
                        this.nextStep();
                    }
                } else if (step.trigger === 'movement') {
                    if (selectedEntity && selectedEntity.type === step.targetType) {
                        if (selectedEntity.targetX !== selectedEntity.x || selectedEntity.targetY !== selectedEntity.y) {
                            this.nextStep();
                        }
                    }
                } else if (step.trigger === 'tool_select') {
                    if (currentTool === step.targetTool) {
                        this.nextStep();
                    }
                } else if (step.trigger === 'build') {
                    // Check if a new entity of targetType exists
                    // We can just check if ANY entity of that type exists that is NOT built yet (just placed)
                    // Or just any entity of that type if we assume they didn't have one before.
                    // For Level 1, they start with none.
                    const hasEntity = entities.some(e => e.type === step.targetType);
                    if (hasEntity) {
                        this.nextStep();
                    }
                }
            }

            draw(ctx) {
                if (!this.active || !this.highlightTarget) return;

                // Find target entity
                let target = null;
                if (this.highlightTarget === 'APEX') {
                    target = entities.find(e => e.type === 'APEX');
                } else if (this.highlightTarget === 'EMITTER') {
                    target = entities.find(e => e.type === 'EMITTER' || e.type === 'AC_EMITTER');
                }

                if (target) {
                    const pulse = Math.sin(Date.now() * 0.005) * 10 + 20;
                    ctx.save();
                    ctx.beginPath();
                    ctx.arc(target.x, target.y, target.width + pulse, 0, Math.PI * 2);
                    ctx.strokeStyle = '#ffeaa7';
                    ctx.lineWidth = 3;
                    ctx.stroke();
                    ctx.restore();
                }
            }
        }

        const tutorialManager = new TutorialManager();

        // --- LEVEL INITIALIZATION: "Sand & Bunkers" ---

        // Game Mode
        let gameMode = null; // 'play' or 'create'

        // LEVEL INITIALIZATION FUNCTIONS
        function loadDefaultMap() {
            // Clear everything
            grid.fill(EMPTY);
            densityGrid.fill(0);
            entities.length = 0;
            packets.length = 0;
            projectiles.length = 0;

            // 1. Border Walls
            for (let x = 0; x < width; x++) {
                setCell(x, 0, WALL);      // Ceiling
                setCell(x, height - 1, WALL); // Floor
            }
            for (let y = 0; y < height; y++) {
                setCell(0, y, WALL);      // Left Wall
                setCell(width - 1, y, WALL); // Right Wall
            }

            // 2. Sand Fill (Bottom Half)
            for (let y = Math.floor(height / 2); y < height - 1; y++) {
                for (let x = 1; x < width - 1; x++) {
                    setCell(x, y, SAND);
                }
            }

            // 3. Bottom Left Room (Sealed)
            {
                const rx = 50, ry = height - 50, rw = 30, rh = 20;
                // Clear interior
                for (let y = ry - rh; y <= ry + rh; y++) {
                    for (let x = rx - rw; x <= rx + rw; x++) {
                        setCell(x, y, EMPTY);
                    }
                }
                // Build Walls
                for (let y = ry - rh - 1; y <= ry + rh + 1; y++) {
                    for (let x = rx - rw - 1; x <= rx + rw + 1; x++) {
                        if (x < rx - rw || x > rx + rw || y < ry - rh || y > ry + rh) {
                            setCell(x, y, WALL);
                        }
                    }
                }
                // Emitter
                let e = new Entity(rx, ry, 'EMITTER');
                e.spawnAmount = 2.0;
                e.productionRate = 60;
                entities.push(e);
            }

            // 4. Bottom Right Room (with Pipe)
            {
                const rx = width - 50, ry = height - 50, rw = 30, rh = 20;
                for (let y = ry - rh; y <= ry + rh; y++) {
                    for (let x = rx - rw; x <= rx + rw; x++) {
                        setCell(x, y, EMPTY);
                    }
                }
                for (let y = ry - rh - 1; y <= ry + rh + 1; y++) {
                    for (let x = rx - rw - 1; x <= rx + rw + 1; x++) {
                        if (x < rx - rw || x > rx + rw || y < ry - rh || y > ry + rh) {
                            setCell(x, y, WALL);
                        }
                    }
                }

                const pipeX = rx;
                const pipeW = 2;
                for (let y = Math.floor(height / 2) - 10; y < ry - rh; y++) {
                    for (let x = pipeX - pipeW; x <= pipeX + pipeW; x++) {
                        setCell(x, y, EMPTY);
                    }
                    setCell(pipeX - pipeW - 1, y, WALL);
                    setCell(pipeX + pipeW + 1, y, WALL);
                }

                let e = new Entity(rx, ry, 'EMITTER');
                e.spawnAmount = 5.0;
                e.productionRate = 30;
                entities.push(e);
            }

            // 5. Spawners (AC Resource Generators)
            entities.push(new Entity(80, 60, 'SPAWNER'));
            entities.push(new Entity(width - 80, height - 50, 'SPAWNER'));
            entities.push(new Entity(width / 2 - 40, 50, 'SPAWNER'));
            entities.push(new Entity(width / 2 + 40, 55, 'SPAWNER'));

            // 6. Player Start
            entities.push(new Entity(width / 2, 50, 'APEX'));
        }

        function loadEmptyMap() {
            // Clear everything
            grid.fill(EMPTY);
            densityGrid.fill(0);
            entities.length = 0;
            packets.length = 0;
            projectiles.length = 0;

            // Just border walls
            for (let x = 0; x < width; x++) {
                setCell(x, 0, WALL);
                setCell(x, height - 1, WALL);
            }
            for (let y = 0; y < height; y++) {
                setCell(0, y, WALL);
                setCell(width - 1, y, WALL);
            }

            // Player Start (Apex ship)
            entities.push(new Entity(width / 2, 50, 'APEX'));
        }

        let campaignProgress = parseInt(localStorage.getItem('woogame_progress')) || 0;
        let currentLevelIndex = 0;

        // MENU FUNCTIONS
        function showLevelSelect() {
            document.getElementById('main-menu').style.display = 'none';
            document.getElementById('level-select').style.display = 'flex';
            const list = document.getElementById('level-list');
            list.innerHTML = '';

            levels.forEach((lvl, idx) => {
                const btn = document.createElement('button');
                btn.className = 'level-btn';
                const locked = idx > campaignProgress;
                btn.disabled = locked;
                btn.innerHTML = `
                    ${lvl.name}
                    <span class="level-status">${locked ? 'üîí' : '‚úÖ'}</span>
                    <div style="font-size: 0.8rem; color: #aaa; margin-top: 5px;">${lvl.description}</div>
                `;
                btn.onclick = () => loadLevel(idx);
                list.appendChild(btn);
            });
        }

        function loadLevel(idx) {
            currentLevelIndex = idx;
            document.getElementById('level-select').style.display = 'none';

            const level = levels[idx];
            if (level.data) {
                // Load Custom Level Data
                gameMode = 'play';
                document.getElementById('main-menu').style.display = 'none';
                document.getElementById('play-controls').style.display = 'block';
                document.getElementById('create-controls').style.display = 'none';
                isPaused = false;

                // Parse Data
                try {
                    const mapData = (typeof level.data === 'string') ? JSON.parse(level.data) : level.data;
                    grid = new Uint32Array(mapData.grid);
                    densityGrid = new Float32Array(mapData.densityGrid);
                    entities.length = 0;
                    mapData.entities.forEach(e => {
                        const ent = new Entity(e.x, e.y, e.type);
                        // Restore properties
                        if (e.spawnRadius !== undefined) ent.spawnRadius = e.spawnRadius;
                        if (e.spawnAmount !== undefined) ent.spawnAmount = e.spawnAmount;
                        if (e.productionRate !== undefined) ent.productionRate = e.productionRate;
                        if (e.mode !== undefined) ent.mode = e.mode;
                        entities.push(ent);
                    });

                    updateUI();
                    tutorialManager.start(idx + 1);
                    loop();
                } catch (e) {
                    console.error("Failed to load level data", e);
                    alert("Error loading level data. Check console.");
                    loadDefaultMap(); // Fallback
                }
            } else {
                // Fallback to default map for now (or empty)
                startGame('play');
            }
        }

        function checkVictory() {
            if (gameMode !== 'play') return;
            // Victory Condition: No Emitters remaining
            const emitters = entities.filter(e => e.type === 'EMITTER');
            if (emitters.length === 0 && entities.length > 0) { // Ensure game has started
                winLevel();
            }
        }

        function winLevel() {
            gameMode = 'victory'; // Stop updates
            document.getElementById('victory-screen').style.display = 'flex';
            if (currentLevelIndex === campaignProgress) {
                campaignProgress++;
                localStorage.setItem('woogame_progress', campaignProgress);
            }
        }

        function nextLevel() {
            document.getElementById('victory-screen').style.display = 'none';
            if (currentLevelIndex + 1 < levels.length) {
                loadLevel(currentLevelIndex + 1);
            } else {
                alert("You've beaten all levels! Returning to menu.");
                returnToMenu();
            }
        }

        function returnToMenu() {
            document.getElementById('victory-screen').style.display = 'none';
            document.getElementById('play-controls').style.display = 'none';
            document.getElementById('create-controls').style.display = 'none';
            document.getElementById('main-menu').style.display = 'flex';
            isPaused = false;
        }

        function startGame(mode) {
            gameMode = mode;
            document.getElementById('main-menu').style.display = 'none';

            if (mode === 'play') {
                document.getElementById('play-controls').style.display = 'block';
                document.getElementById('create-controls').style.display = 'none';
                isPaused = false;
                loadDefaultMap();
            } else if (mode === 'create') {
                document.getElementById('play-controls').style.display = 'none';
                document.getElementById('create-controls').style.display = 'block';
                isPaused = true; // Start paused in create mode
                const btn = document.getElementById('btn-play-pause');
                if (btn) btn.innerText = '‚ñ∂Ô∏è';
                loadEmptyMap();
            }

            updateUI();
            loop();
        }

        function saveMap() {
            const mapData = {
                grid: Array.from(grid),
                densityGrid: Array.from(densityGrid),
                entities: entities.map(e => ({
                    x: e.x,
                    y: e.y,
                    type: e.type,
                    // Save specific properties if needed
                    spawnRadius: e.spawnRadius,
                    spawnAmount: e.spawnAmount,
                    productionRate: e.productionRate,
                    mode: e.mode
                }))
            };

            const mapName = prompt('Enter map name:', 'MyMap');
            if (mapName) {
                localStorage.setItem(`woogame_map_${mapName}`, JSON.stringify(mapData));
                alert(`Map "${mapName}" saved!`);
            }
        }

        function exportMap() {
            const mapData = {
                grid: Array.from(grid),
                densityGrid: Array.from(densityGrid),
                entities: entities.map(e => ({
                    x: e.x,
                    y: e.y,
                    type: e.type,
                    spawnRadius: e.spawnRadius,
                    spawnAmount: e.spawnAmount,
                    productionRate: e.productionRate,
                    mode: e.mode
                }))
            };
            const json = JSON.stringify(mapData);
            navigator.clipboard.writeText(json).then(() => {
                alert('Map data copied to clipboard!');
            }).catch(err => {
                console.error('Failed to copy: ', err);
                alert('Failed to copy map data.');
            });
        }

        function loadSavedMap() {
            const mapName = prompt('Enter map name to load:');
            if (mapName) {
                const savedData = localStorage.getItem(`woogame_map_${mapName}`);
                if (savedData) {
                    const mapData = JSON.parse(savedData);
                    grid = new Uint8Array(mapData.grid);
                    densityGrid = new Float32Array(mapData.densityGrid);
                    entities.length = 0;
                    packets.length = 0;
                    projectiles.length = 0;

                    mapData.entities.forEach(eData => {
                        entities.push(new Entity(eData.x, eData.y, eData.type));
                    });

                    alert(`Map "${mapName}" loaded!`);
                    updateUI();
                } else {
                    alert(`Map "${mapName}" not found!`);
                }
            }
        }

        // Don't auto-start - wait for menu selection
        updateUI();

    </script>
